1,NULL,NULL,1,NULL,1192,NULL,0),(16836,319,'Amarr Deadspace Refiner','Built to reprocess ores into minerals without the tedious interlude of a station visit. All for the glory of the Emperor and the prominence of the Amarr Empire.',100000,100000000,10000,1,4,NULL,0,NULL,NULL,NULL,1703),(16837,319,'Amarr Deadspace Repair Unit','The Amarr Empire spreads far and wide and the presence of repair outposts at strategic locations ensures the will of the Emperor prevails in its every far flung corner.',100000,100000000,10000,1,4,NULL,0,NULL,NULL,NULL,1703),(16838,319,'Amarr Deadspace Tactical Unit','Feudal obligations in the Amarr Empire force every lord loyal to the Emperor to participate in the defense of the realm. Tactical outposts serve as the backbone to the first line of defense the empire enjoys.',100000,100000000,10000,1,4,NULL,0,NULL,NULL,NULL,1703),(16839,319,'Asteroid Factory','Highly vulnerable, but economically extremely feasible, asteroid factories are one of the major boons of the expanding space industry.',100000,100000000,10000,1,NULL,NULL,0,NULL,NULL,NULL,1990),(16840,319,'Asteroid Colony','Highly vulnerable, but economically extremely feasible, asteroid factories are one of the major boons of the expanding space industry.',100000,100000000,10000,1,NULL,NULL,0,NULL,NULL,20197,1991),(16841,319,'Asteroid Construct','Carving out asteroids to act as habitats for miners and manufacturers is a cheap and efficient way to quickly cash in on the insatiable needs of the space industry.',100000,100000000,10000,1,NULL,NULL,0,NULL,NULL,NULL,2000),(16842,319,'Asteroid Prime Colony','Carving out asteroids to act as habitats for miners and manufacturers is a cheap and efficient way to quickly cash in on the insatiable needs of the space industry.',100000,100000000,10000,1,NULL,NULL,0,NULL,NULL,20197,1993),(16843,319,'Asteroid Structure','Carving out asteroids to act as habitats for miners and manufacturers is a cheap and efficient way to quickly cash in on the insatiable 