ntegrating ship.',100000,100000000,10000,1,1,NULL,0,NULL,NULL,NULL,1707),(16852,319,'Caldari Deadspace Tactical Outpost','These structures saw heavy use during the days of the Gallente-Caldari war.  Built to allow the State\'s Navy vessels the opportunity to make fortified pit stops in otherwise sparsely populated areas, they were also a tremendous help in pushing back the battle lines.',100000,100000000,10000,1,1,NULL,0,NULL,NULL,NULL,1708),(16853,319,'Circle Construct','A massive circular construction, made of a reinforced tritanium alloy.',100000,100000000,10000,1,NULL,NULL,0,NULL,NULL,NULL,1695),(16854,319,'Pulsating Sensor','Built for up-to-the-minute analysis of tactical and environmental data, these outposts can be found dotted around many a deadspace complex.',100000,100000000,10000,1,1,NULL,0,NULL,NULL,20173,1683),(16855,319,'Gallentean Deadspace Outpost','Equally equipped for scientific observation and entertainment of all sorts, these multi-purpose structures, while not quite big enough to be classified as stations, nonetheless see quite a bit of use by both tourists and professionals.',100000,100000000,10000,1,8,NULL,0,NULL,NULL,14,1712),(16856,319,'Pressure Silo','Built to withstand assault, these behemoths can each hold roughly 8.5 million m3 worth of materials.',100000,100000000,10000,1,NULL,NULL,0,NULL,NULL,NULL,2007),(16857,319,'Minmatar Deadspace Refining Outpost','Though built cheaply, this refinery is able to process most ores at the same level of efficiency found on any station-based refinery platform.',100000,100000000,10000,1,2,NULL,0,NULL,NULL,NULL,1709),(16858,319,'Minmatar Deadspace Repair Outpost','Due to their amazing cost-effectiveness and the speed at which they can be built, these outposts are seeing greater and greater use among Matari freedom fighters and other warriors and travelers who need to be able to stay mobile in dangerous territory.',100000,100000000,10000,1,2,NULL,0,NULL,NULL,20212,1711),(16859,319,'Minmatar Deadspace Tactical Outpost','Outfitted with makeshift sensor arrays and second-hand tactical data analysis equipment, these outposts will, to anyone not in the know, look like useless scrapyards.  Which is exactly what the Matari would have you think.',100000,100000000,10000,1,2,NULL,0,NULL,NULL,NULL,1711),(16860,319,'Freight Pad','Built for up-to-the-minute analysis of tactical and environmental data, these pads can be found dotted around many a deadspace complex.',100000,100000000,10000,1,1,NULL,0,NULL,NULL,20173,1683),(16861,319,'Subspace Frequency Generator','Utilizing advanced auto-locomotive electrocardic subroutines, this miniscule generator is able to generate power equal to far bigger versions of older models.',100000,100000000,10000,1,NULL,NULL,0,NULL,NULL,20178,1684),(16862,319,'Blasted Neon Sign','Once the pride and joy of its parent corporation, this broken-down heap of neon and metal is now no more than a symbolic manifestation of capitalistic decline.',100000,100000000,10000,1,NULL,NULL,0,NULL,NULL,NULL,2369),(16864,319,'Low-Tech Deadspace Energy Harvester','Containing only a handful of mechanical components, this simple wonder harvests energy from the system\'s sun by virtue of the unique EM refractive qualities in its scartate fabric.',100000,100000000,10000,1,NULL,NULL,0,NULL,NULL,NULL,1725),(16865,319,'Rapid Pulse Sentry','Emitting a high-frequency electromagnetic pulse, this scanner sentry is able to assimilate and store environmental data with remarkable efficiency.  Particularly effective at picking up miniscule fluctuations in the particle field within its range.',100000,100000000,10000,1,NULL,NULL,0,NULL,NULL,NULL,1217),(16866,319,'Magnetic Retainment Field','This bubble was built around a subspace ionization convergence.  Its main purpose is to contain the energy emanating from the convergence until a way can be found to properly harness it.',100000,100000000,10000,1,NULL,NULL,0,NULL,NULL,20176,1685),(16867,430,'Ultra Fast Mobile Laser Sentry','',100000000