ly Angel Cartel members are supposed to enjoy the last few years of existence. It is popular amongst them to bring with them memorabilia from past conquests and even work on some projects in the quiet and solitude of the Deadspace Complexes.',100000,100000000,10000,1,NULL,NULL,0,NULL,NULL,20202,2515),(17423,314,'Gallente 106 Election Holoreel','This holoreel contains most of the advertisements used in the Gallente propoganda machine for each of the candidates vying for the presidency, as well as a detailed biography of each person.',100,0.5,0,1,NULL,NULL,1,492,1177,NULL,0),(17424,314,'Amarrian Wheat','Cereal grasses have been localized on hundreds of worlds. The grains of the wheat plant make a solid foundation for the production of foodstuffs within empire space. Amarrian Wheat is known for its purity, and has reputedly never been tampered with by genetic engineering.',1000,1.15,0,1,NULL,10000.0000,1,492,1182,NULL,0),(17425,450,'Crimson Arkonor','While fairly invisible to all but the most experienced miners, there are significant molecular differences between arkonor and its crimson counterpart, so-named because of the blood-red veins running through it.\r\n\r\nThe rarest and most sought-after ore in the known universe. A sizable nugget of this can sweep anyone from rags to riches in no time. Arkonor has the largest amount of megacyte of any ore, and also contains some mexallon and tritanium.\r\n\r\nAvailable primarily in <color=\'0xFFFF0000\'>0.0</color> security status solar systems or lower.',1e35,16,0,100,4,3224182.0000,1,512,1277,NULL,0),(17426,450,'Prime Arkonor','Prime arkonor is the rarest of the rare; the king of ores. Giving a 10% greater mineral yield than regular arkonor, this is the stuff that makes billionaires out of people lucky enough to stumble upon a vein.\r\n\r\nThe rarest and most sought-after ore in the known universe. A sizable nugget of this can sweep anyone from rags to riches in no time. Arkonor has the largest amount of megacyte of any ore, and also contains some mexallon and tritanium.\r\n\r\nAvailable primarily in <color=\'0xFFFF0000\'>0.0</color> security status solar systems or lower.',1e35,16,0,100,4,3373716.0000,1,512,1277,NULL,0),(17428,451,'Triclinic Bistot','Bistot with a triclinic crystal system occurs very rarely under natural conditions, but is highly popular with miners due to its extra-high concentrations of the zydrine and megacyte minerals.\r\n\r\nBistot is a very valuable ore as it holds large portions of two of the rarest minerals in the universe, zydrine and megacyte. It also contains a decent amount of pyerite.\r\n\r\nAvailable primarily in <color=\'0xFFFF0000\'>0.0</color> security status solar systems or lower.',1e35,16,0,100,4,2200984.0000,1,514,1273,NULL,0),(17429,451,'Monoclinic Bistot','Monoclinic bistot is a variant of bistot with a slightly different crystal structure. It is highly sought-after, as it gives a slightly higher yield than its straightforward counterpart.\r\n\r\nBistot is a very valuable ore as it holds large portions of two of the rarest minerals in the universe, zydrine and megacyte. It also contains a decent amount of pyerite.\r\n\r\nAvailable primarily in <color=\'0xFFFF0000\'>0.0</color> security status solar systems or lower.',1e35,16,0,100,4,2301400.0000,1,514,1273,NULL,0),(17432,452,'Sharp Crokite','In certain belts, environmental conditions will carve sharp, jagged edges into crokite rocks, resulting in the formation of sharp crokite.\r\n\r\nCrokite is a very heavy ore that is always in high demand because it has the largest ratio of nocxium for any ore in the universe. Valuable deposits of zydrine and tritanium can also be found within this rare ore.\r\n\r\nAvailable primarily in <color=\'0xFFFF0000\'>0.0</color> security status solar systems or lower.',1e35,16,0,100,4,1604280.0000,1,521,1272,NULL,0),(17433,452,'Crystalline Crokite','Crystalline crokite is the stuff of legend in 0.0 space. Not only does it give a 10% greater yield than regular crokite, but chunks of the rock glitter beautifully in just the right light, making crystalline crokite popular as raw material for jewelry.\r\n\r\nCrokite is a very heavy ore that is always in high demand because it has the largest ratio of nocxium for any ore in the universe. Valuable deposits of zydrine and tritanium can also be found within this rare ore.\r\n\r\nAvailable primarily in <color=\'0xFFFF0000\'>0.0</color> security status solar systems or lower.',1e35,16,0,100,4,1680088.0000,1,521,1272,NULL,0),(17436,453,'Onyx Ochre','Shiny black nuggets of onyx ochre look very nice and are occasionally used in ornaments. But the great amount of nocxium is what miners are really after. Like in all else, good looks are only an added bonus. \r\n\r\nConsidered a worthless ore for years, dark ochre was ignored by most miners until improved reprocessing techniques managed to extract the huge amount of isogen inside it. Dark ochre also contains useful amounts of tritanium and nocxium.\r\n\r\nAvailable primarily in <color=\'0xFFFF0000\'>0.0</color> security status solar systems or lower.',1e35,8,0,100,4,807950.0000,1,522,1275,NULL,0),(17437,453,'Obsidian Ochre','Obsidian ochre, the most valuable member of the dark ochre family, was only first discovered a decade ago. The sleek black surface of this ore managed to absorb scanning waves, making obsidian ochre asteroids almost invisible. Advances in scanning technology revealed these beauties at last.\r\n\r\nConsidered a worthless ore for years, dark ochre was ignored by most miners until improved reprocessing techniques managed to extract the huge amount of isogen inside it. Dark ochre also contains useful amounts of tritanium and nocxium.\r\n\r\nAvailable primarily in <color=\'0xFFFF0000\'>0.0</color> security status solar systems or lower.',1e35,8,0,100,4,845350.0000,1,522,1275,NULL,0),(17440,454,'Vitric Hedbergite','When asteroids containing hedbergite pass close to suns or other sources of intense heat can cause the hedbergite to glassify. The result is called vitric hedbergite and has 5% better yield than normal hedbergite. \n\nHedbergite is sought after for its high concentration of nocxium and isogen. However hedbergite also yields some pyerite and zydrine.\n\nAvailable primarily in <color=\'0xFFFF4D00\'>0.2</color> security status solar systems or lower.',1e35,3,0,100,4,355200.0000,1,527,1269,NULL,0),(17441,454,'Glazed Hedbergite','Asteroids containing this shiny ore were formed in intense heat, such as might result from a supernova. The result, known as glazed hedbergite, is a more concentrated form of hedbergite that has 10% higher yield.\n\nHedbergite is sought after for its high concentration of nocxium and isogen. However hedbergite also yields some pyerite and zydrine.\n\nAvailable primarily in <color=\'0xFFFF4D00\'>0.2</color> security status solar systems or lower.',1e35,3,0,100,4,370560.0000,1,527,1269,NULL,0),(17444,455,'Vivid Hemorphite','Hemorphite exists in many different color variations. Interestingly, the more colorful it becomes, the better yield it has. Vivid hemorphite has 5% better yield than its more bland brother.\r\n\r\nWith a large portion of nocxium, hemorphite is always a good find. It is common enough that even novice miners can expect to run into it. Hemorphite also has a bit of tritanium, isogen and zydrine.\r\n\r\nAvailable primarily in <color=\'0xFFFF4D00\'>0.2</color> security status solar systems or lower.',1e35,3,0,100,4,316222.0000,1,528,1282,NULL,0),(17445,455,'Radiant Hemorphite','Hemorphite exists in many different color variations. Interestingly, the more colorful it becomes, the better yield it has. Radiant hemorphite has 10% better yield than its more bland brother.\r\n\r\nWith a large portion of nocxium, hemorphite is always a good find. It is common enough that even novice miners can expect to run into it. Hemorphite also has a bit of tritanium, isogen and zydrine.\r\n\r\nAvailable primarily in <color=\'0xFFFF4D00\'>0.2</color> security status solar systems or lower.',1e35,3,0,100,4,332370.0000,1,528,1282,NULL,0),(17448,456,'Pure Jaspet','Pure Jaspet is popular amongst corporate miners who are looking for various minerals for manufacturing, rather than mining purely for profit.\r\n\r\nJaspet has three valuable mineral types, making it easy to sell. It has a large portion of mexallon plus some nocxium and zydrine.\r\n\r\nAvailable primarily in <color=\'0xFFE58000\'>0.4</color> security status solar systems or lower.',1e35,2,0,100,4,175776.0000,1,529,1279,NULL,0),(17449,456,'Pristine Jaspet','Pristine Jaspet is very rare, which is not so surprising when one considers that it is formed when asteroids collide with comets or ice moons. It has 10% better yield than normal Jaspet.\r\n\r\nJaspet has three valuable mineral types, making it easy to sell. It has a large portion of mexallon plus some nocxium and zydrine.\r\n\r\nAvailable primarily in <color=\'0xFFE58000\'>0.4</color> security status solar systems or lower.',1e35,2,0,100,4,185442.0000,1,529,1279,NULL,0),(17452,457,'Luminous Kernite','Prophets tell of the mystical nature endowed in luminous kernite. To the rest of us, it\'s an average looking ore that has 5% more yield than normal kernite and can make you rich if you mine it 24/7 and live to be very old.\r\n\r\nKernite is a fairly common ore type that yields a large amount of mexallon. Besides mexallon the kernite also has a bit of tritanium and isogen.\r\n\r\nAvailable in <color=\'0xFF00FF00\'>0.7</color> security status solar systems or lower.',1e35,1.2,0,100,NULL,78634.0000,1,523,1270,NULL,0),(17453,457,'Fiery Kernite','Known as Rage Stone to veteran miners after a discovery of a particularly rich vein of it caused a bar brawl of epic proportions in the Intaki Syndicate. It has a 10% higher yield than basic kernite.\r\n\r\nKernite is a fairly common ore type that yields a large amount of mexallon. Besides mexallon the kernite also has a bit of tritanium and isogen.\r\n\r\nAvailable in <color=\'0xFF00FF00\'>0.7</color> security status solar systems or lower.',1e35,1.2,0,100,NULL,82450.0000,1,523,1270,NULL,0),(17455,458,'Azure Plagioclase','Azure plagioclase was made infamous in the melancholic song prose Miner Blues by the Gallentean folk singer Jaroud Dertier three decades ago.\r\n\r\nPlagioclase is not amongst the most valuable ore types around, but it contains a large amount of pyerite and is thus always in constant demand. It also yields some tritanium and mexallon.\r\n\r\nAvailable in <color=\'0xFF4DFFCC\'>0.9</color> security status solar systems or lower.',1e35,0.35,0,100,NULL,13450.0000,1,516,230,NULL,0),(17456,458,'Rich Plagioclase','With rich plagioclase, having 10% better yield than the normal one, miners can finally regard plagioclase as a mineral that provides a noteworthy profit.\r\n\r\nPlagioclase is not amongst the most valuable ore types around, but it contains a large amount of pyerite and is thus always in constant demand. It also yields some tritanium and mexallon.\r\n\r\nAvailable in <color=\'0xFF4DFFCC\'>0.9</color> security status solar systems or lower.',1e35,0.35,0,100,NULL,14092.0000,1,516,230,NULL,0),(17459,459,'Solid Pyroxeres','Solid Pyroxeres, sometimes called the Flame of Dam\'Torsad, is a relative of normal Pyroxeres. The Flame has 5% higher yield than its more common cousin. \r\n\r\nPyroxeres is an interesting ore type, as it is very plain in most respects except one - deep core reprocessing yields a little bit of nocxium, increasing its value considerably. It also has a large portion of tritanium and some pyerite and mexallon.\r\n\r\nAvailable in <color=\'0xFF4DFFCC\'>0.9</color> security status solar systems or lower.',1e35,0.3,0,100,NULL,12444.0000,1,515,231,NULL,0),(17460,459,'Viscous Pyroxeres','Viscous Pyroxeres is the secret behind the success of ORE in the early days. ORE has since then moved into more profitable minerals, but Viscous Pyroxeres still holds a special place in the hearts of all miners dreaming of becoming the next mining moguls of EVE.\r\n\r\nPyroxeres is an interesting ore type, as it is very plain in most respects except one - deep core reprocessing yields a little bit of nocxium, increasing its value considerably. It also has a large portion of tritanium and some pyerite and mexallon.\r\n\r\nAvailable in <color=\'0xFF4DFFCC\'>0.9</color> security status solar systems or lower.',1e35,0.3,0,100,NULL,12744.0000,1,515,231,NULL,0),(17463,460,'Condensed Scordite','Condensed Scordite is a close cousin of normal Scordite, but with 5% better yield. The increase may seem insignificant, but matters greatly to new miners where every ISK counts.\r\n\r\nScordite is amongst the most common ore types in the known universe. It has a large portion of tritanium plus a fair bit of pyerite. Good choice for those starting their mining careers.\r\n\r\nAvailable in <color=\'0xFF33FFFF\'>1.0</color> security status solar systems or lower.',1e35,0.15,0,100,NULL,5246.0000,1,519,1356,NULL,0),(17464,460,'Massive Scordite','Massive Scordite was the stuff of legend in the early days of space exploration. Though it has long since been taken over in value by other ores it still has a special place in the hearts of veteran miners.\r\n\r\nScordite is amongst the most common ore types in the known universe. It has a large portion of tritanium plus a fair bit of pyerite. Good choice for those starting their mining careers.\r\n\r\nAvailable in <color=\'0xFF33FFFF\'>1.0</color> security status solar systems or lower.',1e35,0.15,0,100,NULL,5496.0000,1,519,1356,NULL,0),(17466,461,'Bright Spodumain','Spodumain is occasionally found with crystalline traces in its outer surface. Known as bright spodumain, the crystal adds considerable value to an already valuable mineral.  \r\n\r\nSpodumain is amongst the most desirable ore types around, as it contains high volumes of the four most heavily demanded minerals. Huge volumes of tritanium and pyerite, as well as moderate amounts of mexallon and isogen can be obtained by refining these rocks.\r\n\r\nAvailable primarily in <color=\'0xFFFF0000\'>0.0</color> security status solar systems or lower.',1e35,16,0,100,4,1206870.0000,1,517,1274,NULL,0),(17467,461,'Gleaming Spodumain','Once in a while Spodumain is found with crystalline veins running through it. The 10% increased value this yields puts a gleam in the eye of any miner lucky enough to find it.\r\n\r\nSpodumain is amongst the most desirable ore types around, as it contains high volumes of the four most heavily demanded minerals. Huge volumes of tritanium and pyerite, as well as moderate amounts of mexallon and isogen can be obtained by refining these rocks.\r\n\r\nAvailable primarily in <color=\'0xFFFF0000\'>0.0</color> security status solar systems or lower.',1e35,16,0,100,4,1264340.0000,1,517,1274,NULL,0),(17470,462,'Concentrated Veldspar','Clusters of veldspar, called concentrated veldspar, are sometimes found in areas where normal veldspar is already in abundance.\r\n\r\nThe most common ore type in the known universe, veldspar can be found almost everywhere. It is still in constant demand as it holds a large portion of the much-used tritanium mineral.\r\n\r\nAvailable in <color=\'0xFF33FFFF\'>1.0</color> security status solar systems or lower.',4000,0.1,0,100,NULL,2100.0000,1,518,232,NULL,0),(17471,462,'Dense Veldspar','In asteroids above average size, the intense pressure can weld normal veldspar into what is known as dense veldspar, increasing the yield by 10%. \r\n\r\nThe most common ore type in the known universe, veldspar can be found almost everywhere. It is still in constant demand as it holds a large portion of the much-used tritanium mineral.\r\n\r\nAvailable in <color=\'0xFF33FFFF\'>1.0</color> security status solar systems or lower.',4000,0.1,0,100,NULL,2200.0000,1,518,232,NULL,0),(17475,282,'Radioactive Waste','This radioactively contaminated material is normally recycled or processed into fuel.  It can be highly dangerous to any lifeforms that come into contact with it.',2000,1,0,1,NULL,NULL,1,NULL,29,NULL,0),(17476,463,'Covetor','The mining barge was designed by <a href=showinfo:30//500014>ORE</a> to facilitate advancing the mining profession to a new level. Each barge was created to excel at a specific function, the Covetor\'s being mining yield and mining laser range. This additional yield comes at a price, as the Covetor has weaker defenses and a smaller ore bay than the other mining barges.\r\n\r\nMining barges are equipped with electronic subsystems specifically designed to accommodate Strip Mining and Ice Harvesting modules.',30000000,200000,350,1,128,20000000.0000,1,494,NULL,20065,2522),(17477,477,'Covetor Blueprint','',0,0.01,0,1,NULL,2000000000.0000,1,497,NULL,NULL,46),(17478,463,'Retriever','The mining barge was designed by <a href=showinfo:30//500014>ORE</a> to facilitate advancing the mining profession to a new level. Each barge was created to excel at a specific function, the Retriever\'s being storage. A massive ore hold allows the Retriever to operate for extended periods without requiring as much support as other barges.\r\n\r\nMining barges are equipped with electronic subsystems specifically designed to accommodate Strip Mining and Ice Harvesting modules.',20000000,150000,450,1,128,5000000.0000,1,494,NULL,20066,2523),(17479,477,'Retriever Blueprint','',0,0.01,0,1,NULL,1700000000.0000,1,497,NULL,NULL,46),(17480,463,'Procurer','The mining barge was designed by <a href=showinfo:30//500014>ORE</a> to facilitate advancing the mining profession to a whole new level. Each barge was created to excel at a specific function, the Procurer\'s being durability and self-defense.\r\n\r\nMining barges are equipped with electronic subsystems specifically designed to accommodate Strip Mining and Ice Harvesting modules.',10000000,100000,350,1,128,1000000.0000,1,494,NULL,20067,2524),(17481,477,'Procurer Blueprint','',0,0.01,0,1,NULL,1400000000.0000,1,497,NULL,NULL,46),(17482,464,'Strip Miner I','A bulk ore extractor designed for use on Mining Barges and Exhumers.',0,25,0,1,NULL,NULL,1,1040,2527,NULL,11147),(17483,490,'Strip Miner I Blueprint','',0,0.01,0,1,NULL,16130080.0000,1,338,1061,NULL,0),(17484,511,'Republic Fleet Rapid Light Missile Launcher','Launcher for cruisers intended to counter fast frigates, can only be fitted with regular light missiles.',0,10,0.315,1,2,4224.0000,1,641,1345,NULL,20094),(17485,506,'Republic Fleet Cruise Missile Launcher','A battleship mounted launcher used for long range standoffs with other battleships, but less suitable for bombardment of deployed structures. Contains a huge missile capacity, but has a slow firing rate and trouble targeting small, fast ships. ',0,20,1.35,1,NULL,99996.0000,1,643,2530,NULL,20076),(17486,136,'Republic Fleet Cruise Missile Launcher Blueprint','',0,0.01,0,1,NULL,NULL,1,NULL,170,NULL,170),(17487,510,'Republic Fleet Heavy Missile Launcher','Designed for long engagements between medium sized ships. Slow firing rate, but makes up for it with a large missile capacity.',0,10,1.23,1,2,14996.0000,1,642,169,NULL,20080),(17488,507,'Republic Fleet Rocket Launcher','A tiny launcher that can carry a very limited supply of rockets. Not really intended as a primary weapon but rather as a cheap supplementary weapon system.',0,5,0.2531,1,NULL,3000.0000,1,639,1345,NULL,20088),(17489,136,'Republic Fleet Rocket Launcher Blueprint','',0,0.01,0,1,NULL,NULL,1,NULL,1345,NULL,0),(17490,508,'Republic Fleet Torpedo Launcher','A massive launcher designed for extended bombardments of hard targets like battleships and stations. Contains a huge missile capacity, but has a slow firing rate and trouble targeting small, fast ships.',0,20,2,1,2,20580.0000,1,644,170,NULL,20071),(17491,509,'Republic Fleet Light Missile Launcher','Favored by many for its average capacity and firing rate. Useful in both fast attack raids and longer battles.\r\n',0,5,0.9,1,2,3000.0000,1,640,168,NULL,20096),(17492,62,'Republic Fleet Large Armor Repairer','This module u