nd rescue vessel with strong combat capabilities. In response to the increasing need for ships capable of countering frigate swarms, its designers additionally included a drone bay intended to give the ship a greater range of options when faced with mixed enemy squadrons. The end result is a somewhat more flexible offering than Amarr design philosophy generally dictates, but don\'t be fooled: this crusher still packs all the punch one would expect from a ship of the golden fleet.',10850000,101000,400,1,4,NULL,1,1370,NULL,20063,1731),(17710,106,'Omen Navy Issue Blueprint','',0,0.01,0,1,NULL,NULL,1,NULL,NULL,NULL,49),(17713,26,'Stabber Fleet Issue','Responding to voices stating that the Stabber needed an upgrade to be viable as a fleet vessel of military standards, the Republic Fleet commissioned the creation of the Fleet Issue Stabber; a slower, hardier version of the original that packs quite a bit more firepower. Being as new as it is on the battlefield, the Fleet Issue Stabber hasn\'t seen many large engagements yet, but its engineers as well as Fleet command are very optimistic about its performance.',10810000,101000,450,1,2,NULL,1,1370,NULL,20078,1884),(17714,106,'Stabber Fleet Issue Blueprint','',0,0.01,0,1,NULL,NULL,1,NULL,NULL,NULL,49),(17715,26,'Gila','Taking what he had learned from his days in the Caldari Navy, Korako The Rabbit\' Kosakami, Gurista leader, decided that he would rub salt in the State\'s wounds by souping up their designs and making strikes against his former masters in ships whose layout was obviously stolen from them. To this end the Gila, bastard twin of the Moa, has served him well.',9600000,101000,440,1,1,NULL,1,1371,NULL,20102,1824),(17716,106,'Gila Blueprint','',0,0.01,0,1,NULL,NULL,1,NULL,NULL,NULL,49),(17718,26,'Phantasm','As with other Sansha ships, not much is known about the origin of this design. Its form - while harshly alien in shape - bears the mark of extremely advanced physics research, lines and corners coalescing to form 