LL,NULL,NULL,43),(17728,27,'Megathron Navy Issue','The powerful Navy Megathron has seen the end of many a threat to the Federation\'s security, and it\'s only getting better. Recent improvements in the original design have paved the way for its use in a wider field of tactical operations than originally intended, making it one of the most useful war vessels to be found anywhere.',98400000,486000,650,1,8,108750000.0000,1,1379,NULL,20072,2139),(17729,107,'Megathron Navy Issue Blueprint','',0,0.01,0,1,NULL,NULL,1,NULL,NULL,NULL,43),(17732,27,'Tempest Fleet Issue','The Fleet Tempest originally came into being as a variant licensed by the Fleet to Core Complexion Inc., who intended to improve on the existing design with their now-famous emphasis on strong defensive capability. The designer, one Enoksur Steidentet, performed so well in this task that the Fleet promptly bought all rights to the design back from him for undisclosed billions, catapulting his small production and design corp into the major leagues.  ',103300000,486000,650,1,2,108750000.0000,1,1379,NULL,20076,2642),(17733,107,'Tempest Fleet Issue Blueprint','',0,0.01,0,1,NULL,NULL,1,NULL,NULL,NULL,43),(17736,27,'Nightmare','When this terror was first seen haunting the spacelanes, rumors abounded about its design, which bore the indelible stamp of Sansha Kuvakei\'s unique madness. Who else, the conspiracy theorists argued, could come up with such marvelously twisted designs?\r\n\r\nThese and other theories were all but confirmed during the Sansha invasions of YC 111-112, as endless swarms of Nightmare fleets descended upon planet dweller and capsuleer alike, eager to serve their returned master Sansha Kuvakei once again.',99300000,486000,665,1,4,108750000.0000,1,1380,NULL,20116,2295),(17737,107,'Nightmare Blueprint','',0,0.01,0,1,NULL,NULL,1,NULL,NULL,NULL,43),(17738,27,'Machariel','While its utilitarian look may not give much of an indication, many are convinced that the Machariel is based on an ancient Jovian design uncovered by the Angel Cartel in one of their extensive exploratory raids into uncharted territory some years ago. Whatever the case may be, this behemoth appeared on the scene suddenly and with little fanfare, and has very quickly become one of the Arch Angels\' staple war vessels.',94680000,595000,665,1,2,108750000.0000,1,1380,NULL,20109,335),(17739,107,'Machariel Blueprint','',0,0.01,0,1,NULL,NULL,1,NULL,NULL,NULL,43),(17740,27,'Vindicator','Basing their design on the Federation Navy\'s much-vaunted Megathron, the Guardian Angels\' engineers set out to create a battleship that would instill fear in anyone fool enough to square off against the Cartel or its Serpentis protectorate. Based on the reputation this ship has engendered, they seem to have succeeded admirably.',105200000,486000,665,1,8,108750000.0000,1,1380,NULL,20120,2157),(17741,107,'Vindicator Blueprint','',0,0.01,0,1,NULL,NULL,1,NULL,NULL,NULL,43),(17742,818,'Uleen Bloodsworn','This is a fighter for the Blood Raiders. She is protecting the assets of the Blood Raiders and may attack anyone she perceives as a threat or easy pickings. Threat level: Very high',2860000,28600,235,1,4,NULL,0,NULL,NULL,NULL,1764),(17743,370,'Uleen Bloodsworn\'s Tag','This gold tag carries the rank insignia equivalent of a sergeant within the Blood Raider pirate cult. It may prove valuable if turned in at proper authorities.',1,0.1,0,1,NULL,NULL,1,750,2317,NULL,0),(17744,821,'Purple Particle Research Patrol','This deadly adversary houses the control bridge for the particle accelerator. Its defenses are considerable.',19000000,19000000,120,1,2,NULL,0,NULL,NULL,31,335),(17745,821,'General Hixous Puxley','Your sensors indicate that this battleship is the source of a lot of coded transmissions.',19000000,19000000,120,1,2,NULL,0,NULL,NULL,31,335),(17746,821,'Supply Headman','This ship looks like a standard Domination Seraphim vessel except this one is fitted with at least double the amount of what you normally see of missile turrets.',19000000,19000000,120,1,2,NULL,0,NULL,NULL,31,335),(17747,494,'Docked & Loaded Mammoth','This Mammoth class industrial seems to be undergoing maintainance, but your sensors indicate that for some purpose, it is protected behind an extremely powerful shield...',100000,100000000,10000,1,2,NULL,0,NULL,NULL,31,309),(17748,494,'Megathron under frantic repair','There is a lot of activity around this partially constructed Megathron. As you start to wonder why, you notice that your sensors indicate it is protected by an extremely durable shield.',100000,100000000,10000,1,NULL,NULL,0,NULL,NULL,31,2408),(17749,821,'The Antimatter Channeler','If you ever saw a silent and unpredictable presence, this would be it.',19000000,19000000,120,1,2,NULL,0,NULL,NULL,31,335),(17754,283,'Activists','People engaged in anti-establishment activity of some sort, most often political or economical in nature.',400,1,0,1,NULL,NULL,1,754,1204,NULL,0),(17755,314,'Pro-Trade Pamphlets','Propaganda prose by supporters of Eman Autrech, singing the praise of free trade and universal love.',1,0.1,0,1,NULL,NULL,1,754,1192,NULL,0),(17756,314,'Virgin Forest Pulp','Tree pulp used to produce paper.',1000,2,0,1,NULL,NULL,1,754,1181,NULL,0),(17757,314,'Bronze Sculpture','Bronze Sculpture of president Souro Foiritan.',100,5,0,1,NULL,NULL,1,NULL,2041,NULL,0),(17759,314,'Silver Sculpture','Silver Sculpture of president Souro Foiritan.',100,5,0,1,NULL,NULL,1,NULL,2041,NULL,0),(17761,314,'Gold Sculpture','Gold sculpture of president Souro Foiritan.',100,5,0,1,NULL,NULL,1,NULL,2041,NULL,0),(17763,319,'Powerful EM Forcefield','A reinforced antimatter generator powered by muonal crystals, creating a perfect circle of electro-magnetic radiance.',100000,100000000,10000,1,NULL,NULL,0,NULL,NULL,NULL,2353),(17764,404,'Ultra Fast Silo','Used to store or provide resources.',100000000,1150,8850,1,NULL,2819328.0000,0,NULL,NULL,NULL,2301),(17765,283,'Exotic Dancers, Female','Exotic dancing is considered an art form, even though not everyone might agree. Exposing the flesh in public places may be perfectly acceptable within the Federation, but in the Amarr Empire it\'s considered a grave sin and a sign of serious deviancy.',50,1,0,1,NULL,NULL,1,23,2543,NULL,0),(17767,283,'Kameiras','An elite type of foot soldier, originally bred from Minmatar slaves by the Amarr Empire. Raised from birth to become soldiers, they serve the Empire, Khanid Kingdom and Ammatar well, although always kept on a tight leash.',90,1,0,1,NULL,50000.0000,1,23,2549,NULL,0),(17769,428,'Fluxed Condensates','When combined with other materials and alloys, fluxed condensates help contribute to a unique quantum state highly conducive to efficient reactor operation.',0,1,0,1,NULL,512.0000,1,500,2664,NULL,0),(17770,426,'Large AutoCannon Battery','Fires a barrage of extra large projectiles at those the Control Tower deems its enemies. Maintains a consistent spread of fire and is able to track the faster-moving targets, but lacks the sheer bludgeoning force of its artillery counterpart.',50000000,5000,2500,1,NULL,10000000.0000,1,594,NULL,NULL,2751),(17771,426,'Medium AutoCannon Battery','Fires a barrage of large projectiles at those the Control Tower deems its enemies. Maintains a consistent spread of fire and is able to track fast-moving targets, but lacks some of the power of its artillery counterpart.',50000000,1000,1000,1,2,2000000.0000,1,594,NULL,NULL,1216),(17772,426,'Small AutoCannon Battery','Fires a barrage of medium projectiles at those the Control Tower deems its enemies. Maintains a very rapid spread of fire and is able to track the fastest targets at close ranges, but lacks some of the punch evidenced by its artillery counterpart.',50000000,500,750,1,2,400000.0000,1,594,NULL,NULL,1216),(17773,417,'XL Torpedo Battery','A torpedo launcher capable of firing the most powerful type of torpedo ever invented. A volley of these deathbringers can make piecemeal of most anything that floats in space.',50000000,5000,4500,1,NULL,12500000.0000,1,479,NULL,NULL,2603),(17774,9,'Ice Field','',1e35,1,0,1,NULL,NULL,0,NULL,2561,NULL,2723),(17775,319,'Starbase Major Assembly Array','Assembly Arrays are oftentimes required to manufacture many high-tech and illegal modules that the empires don\'t want manufactured in their stations.  This is one of the biggest of its kind, able to churn out a great deal of equipment in relatively short order.',100000,100000000,10000,1,2,NULL,0,NULL,NULL,20195,2366),(17776,319,'Starbase Minor Assembly Array','Assembly Arrays are oftentimes required to manufacture many high-tech and illegal modules that the empires don\'t want manufactured in their stations.  While humble in size, this one is able to operate at a high level of efficiency, bringing its operators quality modules with surprising speed.',100000,100000000,10000,1,NULL,NULL,0,NULL,NULL,20195,2377),(17777,319,'Amarr Starbase Control Tower','The Amarr have always been fond of majestic and intimidating constructions. Their Control Towers do not deviate from that tradition and are truly big and powerful structures, intended more for preservation of territorial interests than commercial benefits.',100000,100000000,10000,1,4,NULL,0,NULL,NULL,20204,2593),(17778,319,'Caldari Starbase Control Tower','At first the Caldari Control Towers were manufactured by Kaalakiota, but since they focused their efforts mostly on other, more profitable installations, they soon lost the contract and the Ishukone corporation took over the Control Towers\' development and production.',100000,1150,8850,1,1,NULL,0,NULL,NULL,NULL,2599),(17779,319,'Gallente Starbase Control Tower','Gallente Control Towers are more pleasing to the eye than they are strong or powerful. They have above average electronic countermeasures, average CPU output, and decent power output compared to towers from the other races, but are quite lacking in sophisticated defenses.',100000,1150,8850,1,8,NULL,0,NULL,NULL,NULL,2594),(17780,319,'Minmatar Starbase Control Tower','The Matari aren\'t really that high-tech, preferring speed rather than firepower or involved technology. Unfortunately that doesn\'t apply very well to stationary objects, much to the liking of the Amarr Empire.\r\n\r\nAmarrians call it a scrapheap of epic proportions. But don\'t underestimate these structures. Minmatar commanders usually have the last laugh when it comes to combat.',100000,1150,8850,1,2,NULL,0,NULL,NULL,NULL,2600),(17781,319,'Starbase Hangar','A stand-alone deep-space construction designed to allow pilots to dock and refit their ships on the fly.',100000,1150,8850,1,NULL,NULL,0,NULL,NULL,NULL,2595),(17782,319,'Starbase Ion Field Projection Battery','Projects a low intensity field of ionized particles to disrupt the effectivenes of enemy sensors. Very effective against Magnetometric-based sensors.',100,100,0,1,NULL,NULL,0,NULL,NULL,NULL,2603),(17783,319,'Starbase Force Field Array','This array projects a password-protected force field around structures outside the range of a control tower\'s shields.',100,100,0,1,NULL,NULL,0,NULL,NULL,NULL,2603),(17784,319,'Starbase Auxiliary Power Array','These arrays provide considerable added power output, allowing for an increased number of deployable structures in the starbase\'s field of operation.',100,100,0,1,NULL,NULL,0,NULL,NULL,20181,2374),(17785,319,'Starbase Reactor Array','Moon Harvesting Arrays yield a number of moon materials that are then fed to Reactors. Reactors then process the materials in order to produce intermediate or final materials for use in keeping the Starbase\'s structures on-line and functioning.',1000000,1150,1,1,NULL,NULL,0,NULL,NULL,NULL,2299),(17786,319,'Starbase Shield Generator','Smaller confined shield generators with their own access restrictions can be deployed outside the Control Tower\'s defense perimeter. This allows for lesser security areas around the Starbase, for purposes of storage or pickup. ',1,1,0,1,NULL,NULL,0,NULL,NULL,20195,2380),(17787,319,'Starbase Storage Facility','Storage silos are much more secure and durable than their Secure Container counterparts. They are usually the focus of attacks on outposts and commonly contain ore, reprocessed minerals or valuable items waiting to be transported to empire space.',1000000,1150,8850,1,NULL,NULL,0,NULL,NULL,NULL,2301),(17788,319,'Starbase Moon Harvester','A harvesting factory for collecting moon minerals.',1000000,1150,8850,1,NULL,NULL,0,NULL,NULL,20205,2378),(17789,319,'Starbase Medium Refinery','The refinery is the heart of any industrial outpost, increasing the efficiency of any mining operation through reduced travel time. They are less efficient than full fledged stations, but the benefits of not having to move unrefined ore outweighs this drawback considerably. ',1000000,1150,8850,1,NULL,NULL,0,NULL,NULL,20197,2299),(17790,319,'Starbase Minor Refinery','A factory that refines ore into minerals.',1000000,1150,8850,1,NULL,NULL,0,NULL,NULL,20197,2300),(17791,283,'Freedom Fighters','Freedom Fighters have dedicated their life to freeing those who have been enslaved by the Amarr Empire, Khanid Kingdom or various pirate factions. Their purpose is to bring freedom and equality to the population of the galaxy.\r\n\r\nBut although their ultimate goal may be noble, their methods are often not approved by the Minmatar authorities, nor their allies the Gallente Federation. Their opponents call them terrorists, and they have been banned from the Caldari State due to the State\'s historical relationship with the Khanid Kingdom.',400,2,0,1,NULL,NULL,1,23,2544,NULL,0),(17793,314,'Amarr TIL-1 Nexus Chip','This small data chip stores the key elements of a ship\'s artificial intelligence system, and is used primarily for controlling the vessel\'s autonomous functions. This particular chip has been modified by top Viziam scientists for the Imperial Navy, made to be of better quality than what is available on the open market. \r\n\r\nThe TIL-1 chip is designed for battleship class vessels.',1,0.1,0,1,NULL,8000000.0000,1,738,2038,NULL,0),(17794,314,'Amarr KIU-1 Nexus Chip','This small data chip stores the key elements of a ship\'s artificial intelligence system, and is used primarily for controlling the vessel\'s autonomous functions. This particular chip has been modified by top Viziam scientists for the Imperial Navy, made to be of better quality than what is available on the open market. \r\n  \r\nThe KIU-1 chip is designed for cruiser class vessels.',1,0.1,0,1,NULL,2000000.0000,1,738,2038,NULL,0),(17795,314,'Amarr MIY-1 Nexus Chip','This small data chip stores the key elements of a ship\'s artificial intelligence system, and is used primarily for controlling the vessel\'s autonomous functions. This particular chip has been modified by top Viziam scientists for the Imperial Navy, made to be of better quality than what is available on the open market. \r\n \r\nThe MIY-1 chip is designed for frigate class vessels.',1,0.1,0,1,NULL,500000.0000,1,738,2038,NULL,0),(17796,283,'Elite Slaves','Slavery has always been a questionable industry, favored by the Amarr Empire and detested by the Gallente Federation. These elite slaves are exceptionally well suited for physical labor.',300,1,0,1,NULL,4000.0000,1,23,2541,NULL,0),(17798,496,'Dented Cask','This reinforced container is outfitted with a capturing mechanism to pick up data from nearby sensor arrays. The cargo ship carrying this to its destination seems to have met some kind of disasterous end.',10000,1200,1000,1,NULL,NULL,0,NULL,16,31,1176),(17799,494,'Non-Secured Asteroid Colony','Carving out asteroids to act as habitats for miners and manufacturers is a cheap and efficient way to quickly cash in on the insatiable needs of the space industry. The construction of this one is underway and the defenses are weak.',100000,100000000,10000,1,NULL,NULL,0,NULL,NULL,31,1993),(17800,819,'Retired Mining Veteran','The communication sensors on your ship are going haywire. Judging from the signals and coding being transmitted from this vessel, it could just be the big cahuna in this deadspace pocket. Who knows?',1612000,16120,80,1,1,NULL,0,NULL,NULL,31,1827),(17801,409,'Akori\'s Insignia','Identification tags such as these may prove valuable if handed to the proper organization.',0.1,0.1,0,1,1,NULL,1,NULL,2040,NULL,0),(17802,409,'Ibrahim\'s Insignia','Identification tags such as these may prove valuable if handed to the proper organization.',0.1,0.1,0,1,4,NULL,1,NULL,2040,NULL,0),(17803,409,'Karothas\'s Insignia','Identification tags such as these may prove valuable if handed to the proper organization.',0.1,0.1,0,1,1,NULL,1,NULL,2040,NULL,0),(17812,25,'Republic Fleet Firetail','The Firetail is modeled off a fighter frigate known as the Shamrock, a design used by a small, now-extinct pirate faction known as Lazari Dromitus. The blueprint found its way into the hands of Matari military forces after a raid on Lazari Dromitus\'s headquarters succeeded in killing its leader, thus beheading the organization and scattering its remnants to the four winds. It has since been improved upon and upgraded, and the Firetail is now a mainstay in most Republic Fleet patrols.',1098000,16500,135,1,2,NULL,1,1366,NULL,20078,2635),(17813,105,'Republic Fleet Firetail Blueprint','',0,0.01,0,1,NULL,NULL,1,NULL,NULL,NULL,314),(17814,314,'Minmatar UUC Nexus Chip','This small data chip stores the key elements of a ship\'s artificial intelligence system, and is used primarily for controlling the vessel\'s autonomous functions. This particular chip has been modified by top Boundless Creation scientists for the Minmatar Fleet, made to be of better quality than what is available on the open market. \r\n\r\nThe UUC chip is designed for battleship class vessels.',1,0.1,0,1,NULL,8000000.0000,1,738,2038,NULL,0),(17815,314,'Minmatar UUA Nexus Chip','This small data chip stores the key elements of a ship\'s artificial intelligence system, and is used primarily for controlling the vessel\'s autonomous functions. This particular chip has been modified by top Boundless Creation scientists for the Minmatar Fleet, made to be of better quality than what is available on the open market. \r\n \r\nThe UUA chip is designed for frigate class vessels.',1,0.1,0,1,NULL,500000.0000,1,738,2038,NULL,0),(17816,314,'Minmatar UUB Nexus Chip','This small data chip stores the key elements of a ship\'s artificial intelligence system, and is used primarily for controlling the vessel\'s autonomous functions. This particular chip has been modified by top Boundless Creation scientists for the Minmatar Fleet, made to be of better quality than what is available on the open market. \r\n  \r\nThe UUB chip is designed for cruiser class vessels.',1,0.1,0,1,NULL,2000000.0000,1,738,2038,NULL,0),(17817,409,'Genom Tara\'s Insignia','Identification tags such as these may prove valuable if handed to the proper organization.  \r\n\r\nGenom Tara is a legendary Ammatar commander who bears deep hatred of the Minmatar Republic.  He is most notable for refusing to obey direct orders from the Ammatar government to withdraw from his position in the Minmatar - Ammatar border.',0.1,0.1,0,1,2,NULL,1,737,2040,NULL,0),(17818,494,'Serpentis Supply Stronghold','This gigantic station is one of the Serpentis military installations and a black jewel of the alliance between The Guardian Angels and The Serpentis Corporation. Even for it\'s size it has no commercial station services or docking bay to receive guests.',100000,100000000,10000,1,8,NULL,0,NULL,NULL,20193,20651),(17820,494,'Supply Traffic Management','Equally equipped for scientific observation and entertainment of all sorts, these multi-purpose structures, while not quite big enough to be classified as stations, nonetheless see quite a bit of use by both tourists and professionals.',100000,100000000,10000,1,8,NULL,0,NULL,NULL,20195,1712),(17821,494,'Slaver Rig Control Tower','Amarr Control Tower',100000,100000000,10000,1,4,NULL,0,NULL,NULL,20195,2593),(17822,494,'Staff Quarters','The architectural design for the CreoDron Habitation Module started out as a contract deal from the Expert Housing Corporation to standardize the modular drifter homes normally used by miners and deep space explorers. When the project was cancelled due to insufficient funding, CreoDron utilized their design for the open market as high-orbit department buildings for commercial use. The marketing was a tremendous hit, making the Habitation Module a common sight across the universe. Common uses include anything from bars, casinos and brothels, to police stations and interrogation facilities.',100000,100000000,10000,1,NULL,NULL,0,NULL,NULL,31,2515),(17823,820,'Serpentis Chief of Security','This is a fighter for the Serpentis Corporation. It is protecting the assets of the Serpentis Corporation and may attack anyone it perceives as a threat or easy pickings. Threat level: Deadly',11200000,112000,480,1,8,NULL,0,NULL,NULL,31,1815),(17824,820,'Serpentis Refinery Headmaster','This is a fighter for the Serpentis Corporation. It is protecting the assets of the Serpentis Corporation and may attack anyone it perceives as a threat or easy pickings. Threat level: Extreme',11600000,116000,900,1,8,NULL,0,NULL,NULL,31,1812),(17826,474,'Traffic Management Passkey','This security passkey is manufactured by the Serpentis Corporation and allows the user to unlock a specific acceleration gate to a check-in tunnel. The gate will remain open for a short period of time and the passkey will be rendered useless after uploading the key\'s data to the gate\'s activation device.',1,0.1,0,1,NULL,NULL,1,NULL,2038,NULL,0),(17827,474,'Serpentis Staff Passcard','This security passcard is distributed by the Serpentis Corporation and allows the user to unlock a specific acceleration gate to central warehouses. The gate will remain open for a short period of time and the passkey will be rendered useless after uploading the card\'s data to the gate\'s activation device.',1,0.1,0,1,NUL