 moon made this uncommon cousin of normal Omber seem silvery in appearance, hence the name.\r\n\r\nOmber is a common ore that is still an excellent ore for novice miners as it has a sizeable portion of isogen, as well as some tritanium and pyerite. A few trips of mining this and a novice is quick to rise in status.\r\n\r\nAvailable in <color=\'0xFF00FF00\'>0.7</color> security status solar systems or lower.',1e35,0.6,0,100,NULL,42892.0000,1,526,1271,NULL,0),(17868,469,'Golden Omber','Golden Omber spurred one of the largest gold rushes in the early days of space faring, when isogen was the king of minerals. The 10% extra yield it offers over common Omber was all it took to make it the most sought after ore for a few years.\r\n\r\nOmber is a common ore that is still an excellent ore for novice miners as it has a sizeable portion of isogen, as well as some tritanium and pyerite. A few trips of mining this and a novice is quick to rise in status.\r\n\r\nAvailable in <color=\'0xFF00FF00\'>0.7</color> security status solar systems or lower.',1e35,0.6,0,100,NULL,45020.0000,1,526,1271,NULL,0),(17869,468,'Magma Mercoxit','Though it floats through the frigid depths of space, magma mercoxit\'s striking appearance and sheen gives it the impression of bubbling magma. If this visual treasure wasn\'t enticing enough, the 5% higher yield certainly attracts admirers.\r\n\r\nMercoxit is a very dense ore that must be mined using specialized deep core mining techniques. It contains massive amounts of the extraordinary morphite mineral but few other minerals of note.\r\n\r\nAvailable in <color=\'0xFFFF0000\'>0.0</color> security status solar systems or lower.',1e35,40,0,100,NULL,18251776.0000,1,530,2102,NULL,0),(17870,468,'Vitreous Mercoxit','Vitreous mercoxit gleams in the dark, like a siren of myth. Found only in rare clusters in space vitreous mercoxit is very rare, but very valuable, due to its much higher 10% yield.\r\n\r\nMercoxit is a very dense ore that must be mined using specialized deep core mining techniques. It contains massive amounts of the extraordinary morphite mineral but few other minerals of note.\r\n\r\nAvailable in <color=\'0xFFFF0000\'>0.0</color> security status solar systems or lower.',1e35,40,0,100,NULL,19103744.0000,1,530,2102,NULL,0),(17871,738,'Inherent Implants \'Noble\' Remote Armor Repair Systems RA-703','A neural Interface upgrade that boosts the pilot\'s skill in the operation of remote armor repair systems.\r\n\r\n3% reduced capacitor need for remote armor repair system modules.',0,1,0,1,NULL,NULL,1,1515,2224,NULL,0),(17873,472,'System Scanner I','Scans the ore make-up of an asteroid.',0,5,0,1,NULL,NULL,0,NULL,107,NULL,0),(17874,478,'System Scanner I Blueprint','',0,0.01,0,1,NULL,NULL,0,NULL,107,NULL,0),(17875,383,'Sentinel Angel','This Angel Station has been refitted with huge XL torpedo batteries and a long range stasis web generators  ',1000,1000,1000,1,2,NULL,0,NULL,NULL,20191,2357),(17876,383,'Sentinel Sansha','This Sansha Station has been refitted with huge XL torpedo batteries and a long range stasis web generators ',1000,1000,1000,1,4,NULL,0,NULL,NULL,20188,2364),(17877,383,'Sentinel Serpentis','This Serpentis Battlestation has several formidable defensive systems. ',1000,1000,1000,1,8,NULL,0,NULL,NULL,20193,20651),(17878,383,'Sentinel Chimera Strain Mother','This Drone station has several formidable defensive systems. ',1000,1000,1000,1,NULL,NULL,0,NULL,NULL,NULL,2565),(17879,383,'Sentinel Jormungand Strain Mother','This Drone station has several formidable defensive systems. ',1000,1000,1000,1,NULL,NULL,0,NULL,NULL,NULL,2430),(17880,383,'Sentinel Gallente','This Gallente Battlestation has several formidable defensive systems. ',1000,1000,1000,1,NULL,NULL,0,NULL,NULL,NULL,2430),(17884,472,'Recon System Scanner','An advanced version of the system scanner. Scans the system for micro gravity wells in an attempt to locate something the ship\'s gravity capacitor can lock onto and thus warp to. Generally used 