s, sometimes hundreds of thousands, of slaves pour their blood, sweat and tears into erecting one of these mega-structures.  Only a fool would attempt to assault such a massive base without a fleet behind him.\r\n\r\nDocking has been prohibited into this station without proper authorization.',0,0,0,1,4,NULL,0,NULL,NULL,26,1069),(26122,526,'Pillaging 101','This informative brochure contains helpful diagrams and elaborate tutorials on how to effectively function as a successful brigand. Key chapters include:<br>\r\n<br>\r\nPriority Pillaging  Triage style tactics for post-combat logistics<br>\r\nPursuing Passersby  Why anonymity is more useful than infamy<br>\r\nPunishing Pirates  What to do with a drunken crewman early in the morning<br>\r\n<br>\r\nThis handy guide could turn even the noblest capsuleer into a ruthless raider in just a few short years of night courses.\r\n',1,0.1,0,1,NULL,NULL,1,NULL,2038,NULL,0),(26123,526,'The Little Pirate That Could','An inspirational story if there ever was one. Fills every pirate wannabe with pride.',1,0.1,0,1,NULL,NULL,1,NULL,2038,NULL,0),(26124,526,'17 Successful Torture Techniques','You can only wonder about the dedication in filtering the successful techniques from the unsuccessful ones.',1,0.1,0,1,NULL,NULL,1,NULL,2038,NULL,0),(26125,526,'Test Bong','A curious device used by pirates to test their own product. Seems heavily used.',100,1,0,1,NULL,NULL,1,NULL,1196,NULL,0),(26126,526,'Flower Power Powder','Oddly smelling powder presumably used by pirates in some of their more exotic formulas.',1000,1,0,1,NULL,NULL,1,NULL,1182,NULL,0),(26127,526,'Angel Cartel Dust','Finely grained dust manufactured by the Angel Cartel for use in hallucination drugs.',1000,1,0,1,NULL,NULL,1,NULL,1182,NULL,0),(26128,370,'Sansha Infiltrator Tag','A dogtag carried by members of the Sansha\'s navy. Members carrying the rank of infiltrator are often tasked with intercepting and deciphering enemy communications.',1,0.1,0,1,NULL,NULL,1,NULL,2332,NULL,0)