ts vicinity on a vector that would theoretically cross its field, will find themselves pulled into its uncaring grasp.',0,65,0,1,NULL,NULL,1,405,2309,NULL,2309),(26893,371,'Mobile Small Warp Disruptor II Blueprint','',0,0.01,0,1,NULL,7485280.0000,1,NULL,21,NULL,0),(26894,319,'Habitation Module - Breeding Facility','The architectural design for the CreoDron Habitation Module started out as a contract deal from the Expert Housing Corporation to standardize the modular drifter homes normally used by miners and deep space explorers. When the project was cancelled due to insufficient funding, CreoDron utilized their design for the open market as high-orbit department buildings for commercial use. The marketing was a tremendous hit, making the Habitation Module a common sight across the universe. Common uses include anything from bars, casinos and brothels, to police stations and interrogation facilities.',100000,100000000,10000,1,NULL,NULL,0,NULL,NULL,NULL,2521),(26895,319,'Amarrian Breeding Facility','This breeding facility produces Minmatar children ready to assume their place as servants to the Amarr. Once they reach puberty, the boys are sent away to take their place amongst the lower classes in Amarr society.\r\n\r\nThe girls, on the other hand, are left behind. Their place is here, stretched out on cold metal tables, silent and tense. The facility wears out its brood, but that\'s all right; more are created all the time.\r\n\r\nAnd every now and then, a caravan will arrive, carrying men with cold eyes and clammy hands, ready and willing to help with the production.',100000,100000000,10000,1,NULL,NULL,0,NULL,NULL,NULL,2520),(26896,319,'Amarr Battlestation_Event','This gigantic military installation is the pride of the Imperial Navy.  Hundreds of thousands, of slaves poured their blood, sweat and tears into erecting one of these mega-structures.  Only a fool would attempt to assault such a massive base without a fleet behind him.\n\nDocking has been prohibited into this station without proper authorization.',0,0,0,1,4,NULL,0,NULL,NULL,18,1249),(26897,319,'Sisters of EVE Aid Station','The Sisters need to rapidly receive and deploy aid has led to the creation of the Aid Stations, relatively quick and easy to construct and place in orbit these stations can recieve vast quantities of aid and transfer them to orbital craft for quick deployment on a planet. Since their inception they have saved vast quantities of lives and other corporations have leased the design for their own purposes.',100000,100000000,10000,1,NULL,NULL,0,NULL,NULL,NULL,2403),(26898,319,'Asteroid Slave Mine','\"There are some who will never embrace enlightment, and those poor souls we must.. educate\"<br>\r\nGavrin Lothril - Asteroid Mine XVII-232 Foreman',0,1,0,1,NULL,NULL,0,NULL,NULL,NULL,1717),(26899,319,'Unlicensed Mindclash Arena','Mind Clash is one of the most popular sports throughout known space, it is as enthusiastically played in the royal court on Amarr Prime as in the gambling halls of the Caldari. However there are a certain cadre of people who think that the official sport is too tame, so they created a new set of rules, to the death - which was promptly banned from Empire space. However their is much underground hunger for this sport so hidden in space arena\'s have started to be constructed in which sport enthusiasts can enjoy watching their heroes fight and die without the inteference of the beaurcratic empires.',100000,100000000,10000,1,NULL,NULL,0,NULL,NULL,NULL,2513),(26900,319,'Broadcast Tower','The Caldari call these propoganda towers, however the Gallente people prefer to call them liberty towers. Whatever their designation these hidden broadcast towers send their amplified signal throughout the system they are located in. The Gallente networks use them to broadcast their channels to areas of space where such signals are usually banned. There are a network of relay towers which utilise the FTL networks to bring their underground signal to the source tower.',100000,100000000,10000,1,NULL,NULL,0,NULL,NULL,20179,2505),(26901,283,'Breeder Slave','These slaves are held within breeder colonies for years for the sole purpose of increasing a slaver\'s stock. Discarded when they have outlived their usefulness, these poor creatures have a short life expectancy that might be a blessing when compared to the misery of their existence in captivity. ',80,1.5,0,1,NULL,NULL,1,NULL,2541,NULL,0),(26902,526,'Fedo','The Fedo is an omnivorous, sponge-like creature. It has reddish skin and numerous small claw-like tentacles which it uses to move around and protect itself. A primitive being, the Fedo\'s method of eating and absorbing nutrition is slow and inefficient. This means that food stays for a long time in the Fedo\'s body, and will most often have rotted or turned foul before the animal passes it out of its system. The Fedos eject fumes from their body which, for the reasons explained above, have a most horrible odor. The Fedos possess a fantastic sense of smell and so use these fumes to communicate with each other; they are however both blind and deaf, having no eyes or ears. The mouth is located on the underside of the beast, and the Fedo feeds by positioning itself over the food and lowering itself down on it.',3000,0.5,0,1,NULL,NULL,1,23,21084,NULL,0),(26903,526,'Military Intelligence Report','A military intelligence report on Fleet movements in the local vicinity, patrol schedules and current strength,',1,0.1,0,1,NULL,NULL,1,NULL,1192,NULL,0),(26904,526,'Secure Coded Package','A generic package containing goods in a protective wrapping. It is secured with a code lock and cannot be opened without knowing the proper combination.',25,120,0,1,NULL,NULL,1,NULL,2039,NULL,0),(26905,526,'Slave Ownership Record','A Record of owner ship of a single slave, previous owners, work history and current state of health',1,0.1,0,1,NULL,NULL,1,NULL,1192,NULL,0),(26906,526,'Slave Manifests','A Manifest of slave movements in the local area, quantity and quality of stock',1,0.1,0,1,NULL,NULL,1,NULL,1192,NULL,0),(26907,283,'Starkmanir Slave','The Starkmanir Tribe was virtually wiped after a failed rebellion, only a handful remain in the Empire and have now turned into collector\'s items for Amarrian Holder\'s. These slave\'s are rarely ever put to hard labour and generally live out their lives as exhibits for their Amarrian masters to show off. A pure blooded Starkmanir slave has made many a Holder a rich man',95,3,0,1,NULL,NULL,1,NULL,2541,NULL,0),(26908,283,'Valkears','\"We aren\'t going to try to train you, we\'re going to try to kill you.\"<br>\r\n- Valklear Instructor\r\n<br><br>\r\nIn the great war for liberation the Minmatar tribes, finding themselves lacking able-bodied men, were forced to create soldiers from their most dangerous criminalstheir thieves, schemers, and murderers. This method proved remarkably successful and continues to this day. One would have to be mad to join in a Valkear unit\'s fifteen-year tour of duty, and among the criminal element, the rivers of madness run deep indeed.',90,1,0,1,2,50000.0000,1,NULL,2549,NULL,0),(26911,226,'Avatar Wreck','These are the remnants of the Avatar-class titan piloted by CYVOK of Ascendant Frontier. It was destroyed by Band of Brothers in the war between the two alliances. The event marked the destruction of the first capsuleer owned titan in existence.',0,0,0,1,NULL,NULL,0,NULL,NULL,NULL,3100),(26912,325,'Small Remote Armor Repairer II','This module uses nano-assemblers to repair damage done to the armor of the Target ship.',20,5,0,1,NULL,4996.0000,1,1059,21426,NULL,0),(26913,325,'Medium Remote Armor Repairer II','This module uses nano-assemblers to repair damage done to the armor of the Target ship.',20,10,0,1,NULL,12470.0000,1,1058,21426,NULL,0),(26914,325,'Large Remote Armor Repairer II','This module uses nano-assemblers to repair damage done to the armor of the Target ship.',20,25,0,1,NULL,31244.0000,1,1057,21426,NULL,0),(26915,350,