 Force Auxiliary\'s ability to provide aid to members of its fleet, as well as a greatly increased rate of defensive self-sustenance. Defensive benefits include improved self-repair and shield boosting effectiveness, as well as increased resistance to most forms of  electronic warfare. As a side effect of the ionic flux created by the triage module, beneficial remote repair and capacitor transfer effects are ineffective against the fitted ship while the module is active.\r\n\r\nThe flux only disrupts incoming effects, however, meaning the Force Auxiliary can still provide aid to its cohorts. Sensor strength and targeting capabilities are also significantly boosted. In addition, the lack of power to locomotion systems means that neither standard propulsion nor warp travel are available to the ship, nor is the Force Auxiliary able to dock until out of triage mode. Finally, any drones currently in space will be unable to deal damage when the module is activated.\r\n\r\nNote: A triage module requires Strontium Clathrates to run and operate effectively. Only one triage module can be run at any given time, so fitting more than one has no practical use. The remote repair module bonuses are only applied to capital sized modules. The increased shield boosting and armor repairing gained from the Triage Module is subject to a stacking penalty when used with other similar modules that affect the same attribute on the ship.\r\n\r\nThis module can only be fit on Force Auxiliary Ships.',1,4000,0,1,NULL,47022756.0000,1,801,3300,NULL,0),(27952,516,'Triage Module I Blueprint','',0,0.01,0,1,NULL,522349680.0000,1,343,21,NULL,0),(27953,383,'Drone Energy Neutralizer Sentry I','This sentry tower will disrupt the capacitor core of any target it considers to be a threat. ',1000,1000,1000,1,NULL,NULL,0,NULL,NULL,NULL,2586),(27954,383,'Drone Energy Neutralizer Sentry II','This sentry tower will disrupt the capacitor core of any target it considers to be a threat. ',1000,1000,1000,1,NULL,NULL,