ve capability and the capacity to fit a clone vat bay. This combination of elements makes the Rorqual the ideal nexus to build deep space mining operations around.\r\n\r\nDue to its specialization towards industrial operations, its ship maintenance bay is able to accommodate only industrial ships, mining barges and their tech 2 variants.',800000000,14500000,40000,1,128,1520784302.0000,1,1048,NULL,20221,3331),(28353,944,'Rorqual Blueprint','',0,0.01,0,1,NULL,3000000000.0000,1,1046,NULL,NULL,309),(28356,885,'Cosmic Anomaly','A cosmic signature.',0,1,0,1,NULL,NULL,0,NULL,0,NULL,10026),(28359,314,'Alliance Tournament Silver Medal','The great Alliance Tournament silver medal. So close, and yet so far. Second place in the Alliance Tournament signifies many things to many people. It does, however, stand for one undeniable truth: the holder kicked several metric tons of arse to get it.\r\n',1,0.1,0,1,NULL,NULL,1,NULL,2093,NULL,0),(28360,314,'Alliance Tournament Bronze Medal','The great Alliance Tournament bronze medal. No capsuleer aims for it, and no one glorifies in it. Some call its holders the worst of the best, but there are victories to be gained even in loss. While glory may elude the holder, honor and respect do not.\r\n',1,0.1,0,1,NULL,NULL,1,NULL,2093,NULL,0),(28361,886,'Drone Synaptic Relay Wiring','The relay wiring of a rogue drones synaptic system, these wires allow for a much higher flow of power and information than standard empire technology has yet to achieve.  ',0.5,0.01,0,1,NULL,NULL,1,1906,3333,NULL,0),(28362,886,'Drone Capillary Fluid','The same fluid that flows through rogue drone relays, this substance is an amalgamation of various chemical compounds that many scientists theorize to be akin to the life blood of a rogue drone.  \r\n\r\nWhatever the reason, the fluid combined with synaptic relays allows for an astonishingly high flow of data.',1,0.02,0,1,NULL,NULL,1,1906,3334,NULL,0),(28363,886,'Drone Cerebral Fragment','A fragment of a rogue drones cerebral cortex.',1,0.03,0,1,NULL,NULL,1,1906,3335,NULL,0),(28364,886,'Drone Tactical Limb','A multipurpose limb of a rogue drone which, in combat models, is a mount for the primary weapon.  The modular design of such limbs allows for them to be incorporated into standard drone designs with some ingenuity.',2,0.07,0,1,NULL,NULL,1,1906,3336,NULL,0),(28365,886,'Drone Epidermal Shielding Chunk','A chunk of the epidermal shielding from a rogue drone, while being both more durable and resistant than standard drone shielding, it is also thinner and more flexible forming, as it does, the skin of a rogue drone.',5,0.1,0,1,NULL,NULL,1,1906,3337,NULL,0),(28366,886,'Drone Coronary Unit','The beating heart of a rogue drone, this power unit is a marvel of technology providing a greater size/power ratio than is currently achievable by modern designs. With some clever tinkering it is possible to adapt this to interface with current drone technology.',2,0.08,0,1,NULL,NULL,1,1906,3338,NULL,0),(28367,450,'Compressed Arkonor','The rarest and most sought-after ore in the known universe. A sizable nugget of this can sweep anyone from rags to riches in no time. Arkonor has the largest amount of megacyte of any ore, and also contains some mexallon and tritanium.\r\n\r\nThis ore is a compressed and much more dense version of the original ore.',1e35,8.8,0,1,4,15680470.0000,1,512,3307,NULL,0),(28368,888,'Compressed Arkonor Blueprint','Note: This blueprint can only be used with the Rorqual Capital Industrial Ships assembly lines.',0,0.01,0,1,NULL,1000000.0000,0,NULL,NULL,NULL,318),(28369,54,'Miner II (China)','Has an improved technology beam, making the extraction process more efficient. Useful for extracting all but the rarest ore.',0,5,0,1,NULL,NULL,0,NULL,1061,NULL,11273),(28373,1218,'Ore Compression','',0,0.01,0,1,NULL,NULL,0,NULL,33,NULL,0),(28374,257,'Capital Industrial Ships','Skill at operating Capital Industrial Ships.',0,0.01,0,1,NULL,500000000.0000,1,377,33,NULL,0),(28375,771,'Republi