t holds large portions of two of the rarest minerals in the universe, zydrine and megacyte. It also contains a decent amount of pyerite.\r\n\r\nThis ore is a compressed and much more dense version of the original ore.',1e35,4.4,0,1,4,10461840.0000,1,514,3308,NULL,0),(28389,451,'Compressed Monoclinic Bistot','Monoclinic bistot is a variant of bistot with a slightly different crystal structure. It is highly sought-after, as it gives a slightly higher yield than its straightforward counterpart.\r\n\r\nBistot is a very valuable ore as it holds large portions of two of the rarest minerals in the universe, zydrine and megacyte. It also contains a decent amount of pyerite.\r\n\r\nThis ore is a compressed and much more dense version of the original ore.',1e35,4.4,0,1,4,11507000.0000,1,514,3308,NULL,0),(28390,451,'Compressed Triclinic Bistot','Bistot with a triclinic crystal system occurs very rarely under natural conditions, but is highly popular with miners due to its extra-high concentrations of the zydrine and megacyte minerals.\r\n\r\nBistot is a very valuable ore as it holds large portions of two of the rarest minerals in the universe, zydrine and megacyte. It also contains a decent amount of pyerite.\r\n\r\nThis ore is a compressed and much more dense version of the original ore.',1e35,4.4,0,1,4,11004920.0000,1,514,3308,NULL,0),(28391,452,'Compressed Crokite','Crokite is a very heavy ore that is always in high demand because it has the largest ratio of nocxium for any ore in the universe. Valuable deposits of zydrine and tritanium can also be found within this rare ore.\r\n\r\nThis ore is a compressed and much more dense version of the original ore.',1e35,7.81,0,1,4,7639790.0000,1,521,3309,NULL,0),(28392,452,'Compressed Crystalline Crokite','Crystalline crokite is the stuff of legend in 0.0 space. Not only does it give a 10% greater yield than regular crokite, but chunks of the rock glitter beautifully in just the right light, making crystalline crokite popular as raw material for jewelry.\r\n\r\nCrokite is a very heavy ore that is always in high demand because it has the largest ratio of nocxium for any ore in the universe. Valuable deposits of zydrine and tritanium can also be found within this rare ore.\r\n\r\nThis ore is a compressed and much more dense version of the original ore.',1e35,7.81,0,1,4,8400440.0000,1,521,3309,NULL,0),(28393,452,'Compressed Sharp Crokite','In certain belts, environmental conditions will carve sharp, jagged edges into crokite rocks, resulting in the formation of sharp crokite.\r\n\r\nCrokite is a very heavy ore that is always in high demand because it has the largest ratio of nocxium for any ore in the universe. Valuable deposits of zydrine and tritanium can also be found within this rare ore.\r\n\r\nThis ore is a compressed and much more dense version of the original ore.',1e35,7.81,0,1,4,8021400.0000,1,521,3309,NULL,0),(28394,453,'Compressed Dark Ochre','Considered a worthless ore for years, dark ochre was ignored by most miners until improved reprocessing techniques managed to extract the huge amount of isogen inside it. Dark ochre also contains useful amounts of tritanium and nocxium.\r\n\r\nThis ore is a compressed and much more dense version of the original ore.',1e35,4.2,0,1,4,3842500.0000,1,522,3310,NULL,0),(28395,453,'Compressed Obsidian Ochre','Obsidian ochre, the most valuable member of the dark ochre family, was only first discovered a decade ago. The sleek black surface of this ore managed to reflect scanning waves, making obsidian ochre asteroids almost invisible. Advances in scanning technology revealed these beauties at last.\r\n\r\nConsidered a worthless ore for years, dark ochre was ignored by most miners until improved reprocessing techniques managed to extract the huge amount of isogen inside it. Dark ochre also contains useful amounts of tritanium and nocxium.\r\n\r\nThis ore is a compressed and much more dense version of the original ore.',1e35,4.2,0,1,4,4226750.0000,1,522,3310,NULL,0),(28396,453,'Compressed Onyx Ochre','Shiny black nuggets of onyx ochre look very nice and are occasionally used in ornaments. But the great amount of isogen is what miners are really after. Like in all else, good looks are only an added bonus. \r\n\r\nConsidered a worthless ore for years, dark ochre was ignored by most miners until improved reprocessing techniques managed to extract the huge amount of isogen inside it. Dark ochre also contains useful amounts of tritanium and nocxium.\r\n\r\nThis ore is a compressed and much more dense version of the original ore.',1e35,4.2,0,1,4,4039750.0000,1,522,3310,NULL,0),(28397,467,'Compressed Gneiss','Gneiss is a popular ore type because it holds significant volumes of three heavily used minerals, increasing its utility value. It has a quite a bit of mexallon as well as some pyerite and isogen.\r\n\r\nThis ore is a compressed and much more dense version of the original ore.',1e35,1.8,0,1,4,3999260.0000,1,525,3321,NULL,0),(28398,467,'Compressed Iridescent Gneiss','Gneiss is often the first major league ore that up and coming miners graduate to. Finding the more expensive variation of Gneiss, called Iridescent Gneiss, is a major coup for these miners.\r\n\r\nGneiss is a popular ore type because it holds significant volumes of three heavily used minerals, increasing its utility value. It has a quite a bit of mexallon as well as some pyerite and isogen.\r\n\r\nThis ore is a compressed and much more dense version of the original ore.',1e35,1.8,0,1,4,4208400.0000,1,525,3321,NULL,0),(28399,467,'Compressed Prismatic Gneiss','Prismatic Gneiss has fracturized molecule-structure, which explains its unique appearance. It is the most sought after member of the Gneiss family, as it yields 10% more than common Gneiss.\r\n\r\nGneiss is a popular ore type because it holds significant volumes of three heavily used minerals, increasing its utility value. It has a quite a bit of mexallon as well as some pyerite and isogen.\r\n\r\nThis ore is a compressed and much more dense version of the original ore.',1e35,1.8,0,1,4,4396720.0000,1,525,3321,NULL,0),(28400,454,'Compressed Glazed Hedbergite','Asteroids containing this shiny ore were formed in intense heat, such as might result from a supernova. The result, known as glazed hedbergite, is a more concentrated form of hedbergite that has 10% higher yield.\n\nHedbergite is sought after for its high concentration of nocxium and isogen. However hedbergite also yields some pyerite and zydrine.\n\nThis ore is a compressed and much more dense version of the original ore.',1e35,0.47,0,1,4,3705600.0000,1,527,3311,NULL,0),(28401,454,'Compressed Hedbergite','Hedbergite is sought after for its high concentration of nocxium and isogen. However hedbergite also yields some pyerite and zydrine.\n\nThis ore is a compressed and much more dense version of the original ore.',1e35,0.47,0,1,4,3374080.0000,1,527,3311,NULL,0),(28402,454,'Compressed Vitric Hedbergite','When asteroids containing hedbergite pass close to suns or other sources of intense heat can cause the hedbergite to glassify. The result is called vitric hedbergite and has 5% better yield than normal hedbergite. \n\nHedbergite is sought after for its high concentration of nocxium and isogen. However hedbergite also yields some pyerite and zydrine.\n\nThis ore is a compressed and much more dense version of the original ore.',1e35,0.47,0,1,4,3552000.0000,1,527,3311,NULL,0),(28403,455,'Compressed Hemorphite','With a large portion of nocxium, hemorphite is always a good find. It is common enough that even novice miners can expect to run into it. Hemorphite also has a bit of tritanium, isogen and zydrine.\r\n\r\nThis ore is a compressed and much more dense version of the original ore.',1e35,0.86,0,1,4,3019920.0000,1,528,3312,NULL,0),(28404,455,'Compressed Radiant Hemorphite','Hemorphite exists in many different color variations. Interestingly, the more colorful it becomes, the better yield it has. Radiant hemorphite has 10% better yield than its more bland brother.\r\n\r\nWith a large portion of nocxium, hemorphite is always a good find. It is common enough that even novice miners can expect to run into it. Hemorphite also has a bit of tritanium, isogen and zydrine.\r\n\r\nThis ore is a compressed and much more dense version of the original ore.',1e35,0.86,0,1,4,3323700.0000,1,528,3312,NULL,0),(28405,455,'Compressed Vivid Hemorphite','Hemorphite exists in many different color variations. Interestingly, the more colorful it becomes, the better yield it has. Vivid hemorphite has 5% better yield than its more bland brother.\r\n\r\nWith a large portion of nocxium, hemorphite is always a good find. It is common enough that even novice miners can expect to run into it. Hemorphite also has a bit of tritanium, isogen and zydrine.\r\n\r\nThis ore is a compressed and much more dense version of the original ore.',1e35,0.86,0,1,4,3162220.0000,1,528,3312,NULL,0),(28406,456,'Compressed Jaspet','Jaspet has three valuable mineral types, making it easy to sell. It has a large portion of mexallon plus some nocxium and zydrine.\r\n\r\nThis ore is a compressed and much more dense version of the original ore.',1e35,0.15,0,1,4,2522370.0000,1,529,3313,NULL,0),(28407,456,'Compressed Pristine Jaspet','Pristine Jaspet is very rare, which is not so surprising when one considers that it is formed when asteroids collide with comets or ice moons. It has 10% better yield than normal Jaspet.\r\n\r\nJaspet has three valuable mineral types, making it easy to sell. It has a large portion of mexallon plus some nocxium and zydrine.\r\n\r\nThis ore is a compressed and much more dense version of the original ore.',1e35,0.15,0,1,4,2781630.0000,1,529,3313,NULL,0),(28408,456,'Compressed Pure Jaspet','Pure Jaspet is popular amongst corporate miners who are looking for various minerals for manufacturing, rather than mining purely for profit.\r\n\r\nJaspet has three valuable mineral types, making it easy to sell. It has a large portion of mexallon plus some nocxium and zydrine.\r\n\r\nThis ore is a compressed and much more dense version of the original ore.',1e35,0.15,0,1,4,2636640.0000,1,529,3313,NULL,0),(28409,457,'Compressed Fiery Kernite','Known as Rage Stone to veteran miners after a discovery of a particularly rich vein of it caused a bar brawl of epic proportions in the Intaki Syndicate. It has a 10% higher yield than basic kernite.\r\n\r\nKernite is a fairly common ore type that yields a large amount of mexallon. Besides mexallon the kernite also has a bit of tritanium and isogen. \r\n\r\nThis ore is a compressed and much more dense version of the original ore.',1e35,0.19,0,1,NULL,1236750.0000,1,523,3314,NULL,0),(28410,457,'Compressed Kernite','Kernite is a fairly common ore type that yields a large amount of mexallon. Besides mexallon the kernite also has a bit of tritanium and isogen.\r\n\r\nThis ore is a compressed and much more dense version of the original ore.',1e35,0.19,0,1,NULL,1123740.0000,1,523,3314,NULL,0),(28411,457,'Compressed Luminous Kernite','Prophets tell of the mystical nature endowed in luminous kernite. To the rest of us, it\'s an average looking ore that has 5% more yield than normal kernite and can make you rich if you mine it 24/7 and live to be very old.\r\n\r\nKernite is a fairly common ore type that yields a large amount of mexallon. Besides mexallon the kernite also has a bit of tritanium and isogen. \r\n\r\nThis ore is a compressed and much more dense version of the original ore.',1e35,0.19,0,1,NULL,1179510.0000,1,523,3314,NULL,0),(28412,468,'Compressed Magma Mercoxit','Though it floats through the frigid depths of space, magma mercoxit\'s striking appearance and sheen gives it the impression of bubbling magma. If this visual treasure wasn\'t enticing enough, the 5% higher yield certainly attracts admirers.\r\n\r\nMercoxit is a very dense ore that must be mined using specialized deep core mining techniques. It contains massive amounts of the extraordinary morphite mineral but few other minerals of note.\r\n\r\nThis ore is a compressed and much more dense version of the original ore.',1e35,0.1,0,1,NULL,36503552.0000,1,530,3322,NULL,0),(28413,468,'Compressed Mercoxit','Mercoxit is a very dense ore that must be mined using specialized deep core mining techniques. It contains massive amounts of the extraordinary morphite mineral but few other minerals of note.\r\n\r\nThis ore is a compressed and much more dense version of the original ore.',1e35,0.1,0,1,NULL,34734080.0000,1,530,3322,NULL,0),(28414,468,'Compressed Vitreous Mercoxit','Vitreous mercoxit gleams in the dark, like a siren of myth. Found only in rare clusters in space vitreous mercoxit is very rare, but very valuable, due to its much higher 10% yield.  \r\n\r\nMercoxit is a very dense ore that must be mined using specialized deep core mining techniques. It contains massive amounts of the extraordinary Morphite mineral but few other minerals of note.\r\n\r\nThis ore is a compressed and much more dense version of the original ore.',1e35,0.1,0,1,NULL,38207488.0000,1,530,3322,NULL,0),(28415,469,'Compressed Golden Omber','Golden Omber spurred one of the largest gold rushes in the early days of space faring, when isogen was the king of minerals. The 10% extra yield it offers over common Omber was all it took to make it the most sought after ore for a few years.\r\n\r\nOmber is a common ore that is still an excellent ore for novice miners as it has a sizeable portion of isogen, as well as some tritanium and pyerite. A few trips of mining this and a novice is quick to rise in status. \r\n\r\nThis ore is a compressed and much more dense version of the original ore.',1e35,0.3,0,1,NULL,675300.0000,1,526,3315,NULL,0),(28416,469,'Compressed Omber','Omber is a common ore that is still an excellent ore for novice miners as it has a sizeable portion of isogen, as well as some tritanium and pyerite. A few trips of mining this and a novice is quick to rise in status. \r\n\r\nThis ore is a compressed and much more dense version of the original ore.',1e35,0.3,0,1,NULL,613410.0000,1,526,3315,NULL,0),(28417,469,'Compressed Silvery Omber','Silvery Omber was first discovered some fifty years ago in an asteroid belt close to a large moon. The luminescence from the moon made this uncommon cousin of normal Omber seem silvery in appearance, hence the name.\r\n\r\nOmber is a common ore that is still an excellent ore for novice miners as it has a sizeable portion of isogen, as well as some tritanium and pyerite. A few trips of mining this and a novice is quick to rise in status. \r\n\r\nThis ore is a compressed and much more dense version of the original ore.',1e35,0.3,0,1,NULL,643380.0000,1,526,3315,NULL,0),(28418,461,'Compressed Bright Spodumain','Spodumain is occasionally found with crystalline traces in its outer surface. Known as bright spodumain, the crystal adds considerable value to an already valuable mineral.  \r\n\r\nSpodumain is amongst the most desirable ore types around, as it contains high volumes of the four most heavily demanded minerals. Huge volumes of tritanium and pyerite, as well as moderate amounts of mexallon and isogen can be obtained by refining these rocks.\r\n\r\nThis ore is a compressed and much more dense version of the original ore.',1e35,28,0,1,4,6034350.0000,1,517,3316,NULL,0),(28419,461,'Compressed Gleaming Spodumain','Once in a while Spodumain is found with crystalline veins running through it. The 10% increased value this yields puts a gleam in the eye of any miner lucky enough to find it.\r\n\r\nSpodumain is amongst the most desirable ore types around, as it contains high volumes of the four most heavily demanded minerals. Huge volumes of tritanium and pyerite, as well as moderate amounts of mexallon and isogen can be obtained by refining these rocks.\r\n\r\nThis ore is a compressed and much more dense version of the original ore.',1e35,28,0,1,4,6321700.0000,1,517,3316,NULL,0),(28420,461,'Compressed Spodumain','Spodumain is amongst the most desirable ore types around, as it contains high volumes of the four most heavily demanded minerals. Huge volumes of tritanium and pyerite, as well as moderate amounts of mexallon and isogen can be obtained by refining these rocks.\r\n\r\nThis ore is a compressed and much more dense version of the original ore.',1e35,28,0,1,4,5747000.0000,1,517,3316,NULL,0),(28421,458,'Compressed Azure Plagioclase','Azure plagioclase was made infamous in the melancholic song prose Miner Blues by the Gallentean folk singer Jaroud Dertier three decades ago.\r\n\r\nPlagioclase is not amongst the most valuable ore types around, but it contains a large amount of pyerite and is thus always in constant demand. It also yields some tritanium and mexallon. \r\n\r\nThis ore is a compressed and much more dense version of the original ore.',1e35,0.15,0,1,NULL,336250.0000,1,516,3320,NULL,0),(28422,458,'Compressed Plagioclase','Plagioclase is not amongst the most valuable ore types around, but it contains a large amount of pyerite and is thus always in constant demand. It also yields some tritanium and mexallon.\r\n\r\nThis ore is a compressed and much more dense version of the original ore.',1e35,0.15,0,1,NULL,320000.0000,1,516,3320,NULL,0),(28423,458,'Compressed Rich Plagioclase','With rich plagioclase, having 10% better yield than the normal one, miners can finally regard plagioclase as a mineral that provides a noteworthy profit.\r\n\r\nPlagioclase is not amongst the most valuable ore types around, but it contains a large amount of pyerite and is thus always in constant demand. It also yields some tritanium and mexallon.\r\n\r\nThis ore is a compressed and much more dense version of the original ore.',1e35,0.15,0,1,NULL,352300.0000,1,516,3320,NULL,0),(28424,459,'Compressed Pyroxeres','Pyroxeres is an interesting ore type, as it is very plain in most respects except one - deep core reprocessing yields a little bit of nocxium, increasing its value considerably. It also has a large portion of tritanium and some pyerite and mexallon. \r\n\r\nThis ore is a compressed and much more dense version of the original ore.',1e35,0.16,0,1,NULL,290800.0000,1,515,3318,NULL,0),(28425,459,'Compressed Solid Pyroxeres','Solid Pyroxeres, sometimes called the Flame of Dam\'Torsad, is a relative of normal Pyroxeres. The Flame has 5% higher yield than its more common cousin. \r\n\r\nPyroxeres is an interesting ore type, as it is very plain in most respects except one - deep core reprocessing yields a little bit of nocxium, increasing its value considerably. It also has a large portion of tritanium and some pyerite and mexallon. \r\n\r\nThis ore is a compressed and much more dense version of the original ore.',1e35,0.16,0,1,NULL,311100.0000,1,515,3318,NULL,0),(28426,459,'Compressed Viscous Pyroxeres','Viscous Pyroxeres is the secret behind the success of ORE in the early days. ORE has since then moved into more profitable minerals, but Viscous Pyroxeres still holds a special place in the hearts of all miners dreaming of becoming the next mining moguls of EVE.\r\n\r\nPyroxeres is an interesting ore type, as it is very plain in most respects except one - deep core reprocessing yields a little bit of nocxium, increasing its value considerably. It also has a large portion of tritanium and some pyerite and mexallon.\r\n\r\nThis ore is a compressed and much more dense version of the original ore.',1e35,0.16,0,1,NULL,318600.0000,1,515,3318,NULL,0),(28427,460,'Compressed Condensed Scordite','Condensed Scordite is a close cousin of normal Scordite, but with 5% better yield. The increase may seem insignificant, but matters greatly to new miners where every ISK counts.\r\n\r\nScordite is amongst the most common ore types in the known universe. It has a large portion of tritanium plus a fair bit of pyerite. Good choice for those starting their mining careers. \r\n\r\nThis ore is a compressed and much more dense version of the original ore.',1e35,0.19,0,1,NULL,131150.0000,1,519,3317,NULL,0),(28428,460,'Compressed Massive Scordite','Massive Scordite was the stuff of legend in the early days of space exploration. Though it has long since been taken over in value by other ores it still has a special place in the hearts of veteran miners.\r\n\r\nScordite is amongst the most common ore types in the known universe. It has a large portion of tritanium plus a fair bit of pyerite. Good choice for those starting their mining careers. \r\n\r\nThis ore is a compressed and much more dense version of the original ore.',1e35,0.19,0,1,NULL,137400.0000,1,519,3317,NULL,0),(28429,460,'Compressed Scordite','Scordite is amongst the most common ore types in the known universe. It has a large portion of tritanium plus a fair bit of pyerite. Good choice for those starting their mining careers. \r\n\r\nThis ore is a compressed and much more dense version of the original ore.',1e35,0.19,0,1,NULL,124850.0000,1,519,3317,NULL,0),(28430,462,'Compressed Concentrated Veldspar','Clusters of veldspar, called concentrated veldspar, are sometimes found in areas where normal veldspar is already in abundance.\r\n\r\nThe most common ore type in the known universe, veldspar can be found almost everywhere. It is still in constant demand as it holds a large portion of the much-used tritanium mineral. \r\n\r\nThis ore is a compressed and much more dense version of the original ore.',4000,0.15,0,1,NULL,52500.0000,1,518,3319,NULL,0),(28431,462,'Compressed Dense Veldspar','In asteroids above average size, the intense pressure can weld normal veldspar into what is known as dense veldspar, increasing the yield by 10%. \r\n\r\nThe most common ore type in the known universe, veldspar can be found almost everywhere. It is still in constant demand as it holds a large portion of the much-used tritanium mineral. \r\n\r\nThis ore is a compressed and much more dense version of the original ore.',4000,0.15,0,1,NULL,55000.0000,1,518,3319,NULL,0),(28432,462,'Compressed Veldspar','The most common ore type in the known universe, veldspar can be found almost everywhere. It is still in constant demand as it holds a large portion of the much-used tritanium mineral. \r\n\r\nThis ore is a compressed and much more dense version of the original ore.',4000,0.15,0,1,NULL,50000.0000,1,518,3319,NULL,0),(28433,465,'Compressed Blue Ice','Interstellar ices are formed by accretion of gas molecules onto silicate dust particles. Due to its unique chemical composition and the circumstances under which it forms, blue ice contains more oxygen isotopes than any other ice asteroid.\r\n\r\nThis ore has been compressed into a much more dense version.',1000,100,0,1,NULL,760000.0000,1,1855,3327,NULL,0),(28434,465,'Compressed Clear Icicle','Interstellar ices are formed by accretion of gas molecules onto silicate dust particles. These crystalline formations can be found scattered around many an ice field, and are known as the universe\'s primary source of helium isotopes.\r\n\r\nThis ore has been compressed into a much more dense version.',1000,100,0,1,NULL,3760000.0000,1,1855,3324,NULL,0),(28435,465,'Compressed Dark Glitter','Dark glitter is one of the rarest of the interstellar ices, formed only in areas with large amounts of residual electrical current. Little is known about the exact way in which it comes into being; the staggering amount of liquid ozone to be found inside one of these rocks makes it an intriguing mystery for stellar physicists and chemists alike. In addition, it contains large amounts of heavy water and a decent measure of strontium clathrates.\r\n\r\nThis ore has been compressed into a much more dense version.',1000,100,0,1,NULL,15500000.0000,1,1855,3325,NULL,0),(28436,465,'Compressed Enriched Clear Icicle','Interstellar ices are formed by accretion of gas molecules onto silicate dust particles. These crystalline formations can be found scattered around many an ice field and are known as the universe\'s primary source of helium isotopes. Due to environmental factors, this fragment\'s isotope deposits have become even richer than its regular counterparts\'.\r\n\r\nThis ore has been compressed into a much more dense version.',1000,100,0,1,NULL,4660000.0000,1,1855,3324,NULL,0),(28437,465,'Compressed Gelidus','Fairly rare and very valuable, Gelidus-type ice formations are a large-scale source of strontium clathrates, one of the rarest ice solids found in the universe, in addition to which they contain unusually large concentrations of heavy water and liquid ozone.\r\n\r\nThis ore has been compressed into a much more dense version.',1000,100,0,1,NULL,8250000.0000,1,1855,3328,NULL,0),(28438,465,'Compressed Glacial Mass','Interstellar ices are formed by accretion of gas molecules onto silicate dust particles. Glacial masses are known to contain hydrogen isotopes in abundance, in addition to smatterings of heavy water and liquid ozone.\r\n\r\nThis ore has been compressed into a much more dense version.',1000,100,0,1,NULL,760000.0000,1,1855,3326,NULL,0),(28439,465,'Compressed Glare Crust','In areas with high concentrations of electromagnetic activity, ice formations such as this one, containing large amounts of heavy water and liquid ozone, are spontaneously formed during times of great electric flux.  Glare crust also contains a small amount of strontium clathrates.\r\n\r\nThis ore has been compressed into a much more dense version.',1000,100,0,1,NULL,15250000.0000,1,1855,3323,NULL,0),(28440,465,'Compressed Krystallos','The universe\'s richest known source of strontium clathrates, Krystallos ice formations are formed only in areas where a very particular combination of environmental factors are at play. Krystallos compounds also include quite a bit of liquid ozone.\r\n\r\nThis ore has been compressed into a much more dense version.',1000,100,0,1,NULL,4500000.0000,1,1855,3330,NULL,0),(28441,465,'Compressed Pristine White Glaze','When star fusion processes occur near high concentrations of silicate dust, such as those found in interstellar ice fields, the substance known as White Glaze is formed. While White Glaze generally is extremely high in nitrogen-14 and other stable nitrogen isotopes, a few rare fragments, such as this one, have stayed free of radioactive contaminants and are thus richer in isotopes than their more impure counterparts.\r\n\r\nThis ore has been compressed into a much more dense version.\r\n',1000,100,0,1,NULL,1160000.0000,1,1855,3329,NULL,0),(28442,465,'Compressed Smooth Glacial Mass','Interstellar ices are formed by accretion of gas molecules onto silicate dust particles. Glacial masses are known to contain hydrogen isotopes in abundance, but the high surface diffusion on this particular mass means it has considerably more than its coarser counterparts.\r\n\r\nThis ore has been compressed into a much more dense version.',1000,100,0,1,NULL,1160000.0000,1,1855,3326,NULL,0),(28443,465,'Compressed Thick Blue Ice','Interstellar ices are formed by accretion of gas molecules onto silicate dust particles. Due to its unique chemical composition and the circumstances under which it forms, blue ice will, under normal circumstances, contain more oxygen isotopes than any other ice asteroid. This particular formation is an old one and therefore contains even more than its less mature siblings.\r\n\r\nThis ore has been compressed into a much more dense version.\r\n',1000,100,0,1,NULL,1160000.0000,1,1855,3327,NULL,0),(28444,465,'Compressed White Glaze','When star fusion processes occur near high concentrations of silicate dust, such as those found in interstellar ice fields, the substance known as White Glaze is formed. White Glaze is extremely high in nitrogen-14 and other stable nitrogen isotopes, and is thus a necessity for the sustained operation of certain kinds of control tower.\r\n\r\nThis ore has been compressed into a much more dense version.',1000,100,0,1,NULL,760000.0000,1,1855,3329,NULL,0),(28448,888,'Compressed Prime Arkonor Blueprint','Note: This bl