 Blueprint','',0,0.01,0,1,NULL,1000000.0000,0,NULL,1142,NULL,1142),(28615,257,'Electronic Attack Ships','Skill for the operation of Electronic Attack Frigates.',0,0.01,0,1,NULL,4000000.0000,1,377,33,NULL,0),(28616,319,'Gallentean Laboratory w/scientists','Equally equipped for scientific observation and entertainment of all sorts, these multi-purpose structures, while not quite big enough to be classified as stations, nonetheless see quite a bit of use by both tourists and professionals.',100000,100000000,10000,1,8,NULL,0,NULL,NULL,14,1712),(28617,462,'Banidine','A variant of the common ore Veldspar, Banidine is found in far lesser abundance - which causes no problems for miners since the latter ore is virtually worthless, being riddled with impurities.\r\n',4000,0.1,0,1,NULL,2000.0000,1,NULL,232,NULL,0),(28618,459,'Augumene','Despite its resemblance to common Pyroxeres, Augumene ore in its raw form is both rare and highly toxic to humans. Thus, while it is also a source of many of the minerals found in Pyroxeres ore, Augumene is generally considered virtually worthless due to the dangers posed by its handling. ',1e35,0.3,0,1,NULL,11632.0000,1,NULL,231,NULL,0),(28619,469,'Mercium','The rare mineral Mercium is thought to be closely related to Omber, varying slightly in chemical composition; in fact, these ores were classified as separate types only recently. However, current refining technologies have been found to do irreparable damage to Mercium ore, rendering it unusable for all practical purposes. ',1e35,0.6,0,1,NULL,40894.0000,1,NULL,1271,NULL,0),(28620,457,'Lyavite','Lyavite is a relatively rare ore quite similar in some respects to Kernite. However, due to the circumstances under which this ore is formed, it is highly unstable when refined; this quality renders it worthless to all but the most desperate of miners. ',1e35,1.2,0,1,NULL,74916.0000,1,NULL,1270,NULL,0),(28621,456,'Pithix','Pithix (sometimes spelled Pythix), sister ore to Jaspet, also contains a myriad of mineral types, but is found only in asteroids of a certain age; this oddity, combined with the fact that current Pithix refining methods are quite inefficient, makes the ore little more than a minor curiosity to the scientific community as a whole. ',1e35,2,0,1,NULL,168158.0000,1,NULL,1279,NULL,0),(28622,467,'Green Arisite','Green Arisite is a close cousin to Gneiss, although it is much less commonly found in known space. It is not at all valuable to miners or refiners, however, since its byproducts tend to foul up refining equipment, thus requiring exorbitant maintenance costs. ',1e35,5,0,1,NULL,399926.0000,1,NULL,1377,NULL,0),(28623,453,'Oeryl','Very similar in composition to Dark Ochre, Oeryl has come into the spotlight only since advanced refining techniques have made Dark Ochre highly sought after for its high isogen content. While refining processes for Oeryl remain utterly ineffective, making this ore worthless to most manufacturers, scientists believe it may become equally as valuable as its Ochre counterpart given a few years of research. ',1e35,8,0,1,4,768500.0000,1,NULL,1275,NULL,0),(28624,452,'Geodite','Geodite ore used to be common, but was mined heavily in the early years of interstellar industry, before the discovery of Crokite. The quality of nocxium taken from Geodite is very poor by today\'s refining standards, making the ore nearly worthless.',1e35,16,0,1,4,1527958.0000,1,NULL,1272,NULL,0),(28625,450,'Polygypsum','The rarest and most valuable ore in the known universe, Arkonor, has a less well known cousin called Polygypsum. While the two are very similar in chemical composition, the latter is quite unstable, having a tendency to ignite when handled roughly. While posing little danger to a spacecraft, which is built to withstand tremendous heat, this property makes the ore too dangerous under any other circumstances - such as in the business of refining. ',1e35,16,0,1,NULL,3068504.0000,1,NULL,1277,NULL,0),(28626,468,'Zuthrine','Zuthrine is one of the most dense ores in known space, a close relative of Mercoxit, it also contains enormous amounts of Morphite.  It is found only in the very core of asteriods it requires specialized deep core mining techniques to extract.',1e35,40,0,1,NULL,17367040.0000,1,NULL,2102,NULL,0),(28627,465,'Azure Ice','Interstellar ices are formed by the accretion of gas molecules onto silicate dust particles. Azure ice forms under the same circumstances as \"blue ice,\" but due to its slightly different chemical composition, it contains substantially fewer oxygen isotopes by volume than its blue cousin, rendering it a \"lesser\" material.',1000,1000,0,1,NULL,NULL,1,NULL,2554,NULL,0),(28628,465,'Crystalline Icicle','Interstellar ices are formed by accretion of gas molecules onto silicate dust particles. These crystalline formations can be found scattered around many stellar ice fields, but \"crystalline icicles\" have a very low isotope count compared to other minable ices, making it relatively worthless. It\'s simply \"space ice.\" ',1000,1000,0,1,NULL,NULL,1,NULL,2556,NULL,0),(28629,711,'Gamboge Cytoserocin','Cytoserocin is a crystalline compound formed by intense pressure deep within large asteroids and moons. It is used in electronics and weapon manufacturing, as well as the production of high-grade combat boosters. Cytoserocin can only be found in a few areas, such as interstellar gas clouds out in low security and 0.0 space.  ',0,10,0,1,NULL,NULL,1,NULL,3225,NULL,3225),(28630,711,'Chartreuse Cytoserocin','Cytoserocin is a crystalline compound formed by intense pressure deep within large asteroids and moons. It is used in electronics and weapon manufacturing, as well as the production of high-grade combat boosters. Cytoserocin can only be found in a few areas, such as interstellar gas clouds out in low security and 0.0 space.  ',0,10,0,1,NULL,NULL,1,NULL,3219,NULL,3219),(28631,272,'Imperial Navy Security Clearance','Fake skill that specifies the owners security clearance for