s. It also prevents any friendly remote effects from being rendered to the parent ship.\r\n\r\nThis module\'s effect can be modified with scripts. When scripted it prevents capital class ships from using stargates (excluding Jump Freighters, Freighters and the Orca). \r\n\r\nNote: Can only be fitted on the Heavy Interdiction Cruisers.',0,50,1,1,NULL,3964874.0000,1,1085,21489,NULL,20396),(28655,132,'Warp Disruption Field Generator I Blueprint','',0,0.01,0,1,NULL,50000000.0000,1,1572,111,NULL,0),(28656,257,'Black Ops','Skill for the operation of Black Ops.',0,0.01,0,1,NULL,64000000.0000,1,377,33,NULL,0),(28659,900,'Paladin','Geared toward versatility and prolonged deployment in hostile environments, Marauders represent the cutting edge in todays warship technology. While being thick-skinned, hard-hitting monsters on their own, they are also able to use Bastion technology. Similar in effect to capital reconfiguration technology, when activated the Bastion module provides immunity to electronic warfare and the ability to withstand enormous amounts of punishment, at the cost of being stationary.\r\n\r\nDeveloper: Carthum Conglomerate \r\n\r\nCarthum ships are the very embodiment of the Amarrian warfare philosophy. Possessing sturdy armor and advanced weapon systems, they provide a nice mix of offense and defense.',92245000,495000,1125,1,4,288874934.0000,1,1081,NULL,20061,3351),(28660,107,'Paladin Blueprint','',0,0.01,0,1,NULL,1800000000.0000,1,NULL,NULL,NULL,297),(28661,900,'Kronos','Geared toward versatility and prolonged deployment in hostile environments, Marauders represent the cutting edge in todays warship technology. While being thick-skinned, hard-hitting monsters on their own, they are also able to use Bastion technology. Similar in effect to capital reconfiguration technology, when activated the Bastion module provides immunity to electronic warfare and the ability to withstand enormous amounts of punishment, at the cost of being stationary.\r\n\r\nDeveloper: Duvolle Labs\r\n\r\nDuvolle Labs manufactures sturdy ships with a good mix of offensive and defensive capabilities. Since the company is one of New Eden\'s foremost manufacturers of particle blasters, its ships tend to favor turrets and thus have somewhat higher power output than normal.',93480000,486000,1275,1,8,280626304.0000,1,1083,NULL,20072,3353),(28662,107,'Kronos Blueprint','',0,0.01,0,1,NULL,1760000000.0000,1,NULL,NULL,NULL,64),(28665,900,'Vargur','Geared toward versatility and prolonged deployment in hostile environments, Marauders represent the cutting edge in todays warship technology. While being thick-skinned, hard-hitting monsters on their own, they are also able to use Bastion technology. Similar in effect to capital reconfiguration technology, when activated the Bastion module provides immunity to electronic warfare and the ability to withstand enormous amounts of punishment, at the cost of being stationary.\r\n\r\nDeveloper: Boundless Creation\r\n\r\nBoundless Creation\'s ships are based on the Brutor Tribe\'s philosophy of warfare: simply fit as much firepower onto your ship as possible. Defense systems and electronics arrays therefore take a back seat to sheer annihilative potential.',96520000,450000,1150,1,2,279247122.0000,1,1084,NULL,20076,3354),(28666,107,'Vargur Blueprint','',0,0.01,0,1,NULL,1450000000.0000,1,NULL,NULL,NULL,48),(28667,257,'Marauders','Skill for the operation of Marauders.',0,0.01,0,1,NULL,64000000.0000,1,377,33,NULL,0),(28668,916,'Nanite Repair Paste','A thick, heavy liquid, typically stored in tanks or container systems intended for liquids. It is composed of billions of nanites that can be programmed to repair damaged ship modules on the fly. The paste is simply applied to the damaged area, and the nanites meld into an exact copy of the damaged area, thus effecting repairs upon the module. This is a one-time process, as the nanites use themselves up along with the trace elements mixed into their carrier fluid.\r\n\r\nThe Repair Paste is generally only used for emergency on-site repairs. It is then recommended to have the damaged components looked at by a certified technician at first opportunity.',2500,0.01,0,10,NULL,6500.0000,1,1103,3302,NULL,0),(28670,303,'Synth Blue Pill Booster','This booster relaxes a pilot\'s ability to control certain shield functions, among other things. It creates a temporary feeling of euphoria that counteracts the unpleasantness inherent in activating shield boosters, and permits the pilot to force the boosters to better performance without suffering undue pain.',1,1,0,1,NULL,8192.0000,1,977,3215,NULL,0),(28671,718,'Synth Blue Pill Booster Blueprint','',0,0.01,0,1,NULL,1000000.0000,1,NULL,21,NULL,0),(28672,303,'Synth Crash Booster','This booster quickens a pilot\'s reactions, pushing him into the delicate twitch territory inhabited by the best missile marksmen. Any missile he launches at his hapless victims will hit its mark with that much more precision, although the pilot may be too busy grinding his teeth to notice.',1,1,0,1,NULL,8192.0000,1,977,3210,NULL,0),(28673,718,'Synth Crash Booster Blueprint','',0,0.01,0,1,NULL,1000000.0000,1,NULL,21,NULL,0),(28674,303,'Synth Drop Booster','This booster throws a pilot into temporary dementia, making every target feel like a monstrous threat that must be destroyed at all cost. The pilot manages to force his turrets into better tracking, though it may take a while before he stops wanting to kill everything in sight.',1,1,0,1,NULL,8192.0000,1,977,3212,NULL,0),(28675,718,'Synth Drop Booster Blueprint','',0,0.01,0,1,NULL,1000000.0000,1,NULL,21,NULL,0),(28676,303,'Synth Exile Booster','This booster hardens a pilot\'s resistance to attacks, letting him withstand their impact to a greater extent. The discomfort of having his armor reduced piecemeal remains unaltered, but the pilot is filled with such a surge of rage that he bullies through it like a living tank.',1,1,0,1,NULL,8192.0000,1,977,3211,NULL,0),(28677,718,'Synth Exile Booster Blueprint','',0,0.01,0,1,NULL,1000000.0000,1,NULL,21,NULL,0),(28678,303,'Synth Frentix Booster','This strong concoction of painkillers helps the pilot block out all inessential thought processes (along with the occasional needed one) and to focus his attention completely on the task at hand. When that task is to hit a target, it certainly makes for better aim, though it does tend to make one\'s extremities go numb for short periods.',1,1,0,1,NULL,8192.0000,1,977,3213,NULL,0),(28679,718,'Synth Frentix Booster Blueprint','',0,0.01,0,1,NULL,1000000.0000,1,NULL,21,NULL,0),(28680,303,'Synth Mindflood Booster','This booster relaxant allows the pilot to control his ship more instinctively and expend less energy in doing so. This in turn lets the ship utilize more of its resources for mechanical functions, most notably its capacitor, rather than constantly having to compensate for the usual exaggerated motions of a stressed pilot.',1,1,0,1,NULL,8192.0000,1,977,3214,NULL,0),(28681,718,'Synth Mindflood Booster Blueprint','',0,0.01,0,1,NULL,1000000.0000,1,NULL,21,NULL,0),(28682,303,'Synth X-Instinct Booster','This energizing booster grants its user a vastly improved economy of effort when parsing the data streams needed to sustain space flight. The main benefits of this lie not in improved performance but less waste of transmission and extraneous micromaneuvers, making the pilot\'s ship sleeker in performance and harder to detect. The booster\'s only major drawback is the crazed notion that the pilot\'s inventory would look so much better if merely rearranged ONE MORE TIME.',1,1,0,1,NULL,8192.0000,1,977,3217,NULL,0),(28683,718,'Synth X-Instinct Booster Blueprint','',0,0.01,0,1,NULL,1000000.0000,1,NULL,21,NULL,0),(28684,303,'Synth Sooth Sayer Booster','This booster induces a trancelike state whereupon the pilot is able to sense the movement of faraway items without all the usual static flooding the senses. Being in a trance helps the pilot hit those moving items w