ant secondary effects.',0,1,0,1,NULL,NULL,1,1506,2224,NULL,0),(28823,306,'Damaged Escape Pod','This Escape Pod has been damaged and has lost its ability to maneuver, as well as its warp capability.',10000,1200,1400,1,NULL,NULL,0,NULL,73,NULL,73),(28826,817,'Opux Luxury Yacht - Level 1','Normally used by the entertainment industry in pleasure tours for wealthy Gallente citizens, this particular Opux Luxury Yacht cruiser is used as a private ship.',13075000,115000,1750,1,8,NULL,0,NULL,NULL,31,330),(28827,314,'Encrypted Data Crystals','These crystals contain data of some sort, but have apparently been encrypted using advanced methods, making the information inaccessible to all but the most skilled hackers. ',50,1,0,1,NULL,80.0000,1,NULL,2886,NULL,0),(28828,314,'Quafe Unleashed formula','These encoded reports contain highly sensitive information from the Quafe corporation regarding the chemical makeup of their new product, Quafe Unleashed.',1,0.1,0,1,NULL,30.0000,1,NULL,1192,NULL,0),(28829,314,'Ancient Amarrian Relic','This relic from Old Amarr is of great value to Lord Horowan, patriarch of one of the oldest noble families in the Empire and liegeman of House Tash-Murkon. \r\n',1,0.1,0,1,NULL,NULL,1,NULL,1656,NULL,0),(28830,314,'Brutor Tribe Roster','These data logs, precious to any Minmatar but especially to a member of the Brutor Tribe, hold information on the history and lineage of that tribe\'s members from over a century ago. ',1,0.2,0,1,NULL,NULL,1,NULL,2038,NULL,0),(28832,283,'Stranded Pilot','This simple starship pilot, lacking the pod and other resources of a capsuleer, has been forced to eject from his ship in a mundane escape pod. ',80,1,0,1,NULL,NULL,1,NULL,2544,NULL,0),(28833,314,'Ishukone Corporate Records','These encoded reports hold extremely sensitive information regarding Ishukone Corporation holdings and infrastructure.',1,0.1,0,1,NULL,NULL,1,NULL,1192,NULL,0),(28834,314,'Federation Court Logs','These reports hold data of utmost importance to Federation Judicial Services. ',10,1,0,1,NULL,NULL,1,NULL,2038,NULL,0),(28835,283,'Professor Kajurei Delainen','This odd little man is possibly the most well-respected particle physicist of the current age, and is also considered a foremost expert in Artificial Intelligence. He is perhaps most famous for his establishment of the \"Seven Pillars of Artificial Intelligence\" theory, published almost 14 years ago.',65,1,0,1,NULL,NULL,1,NULL,2891,NULL,0),(28836,314,'Letters of Bishop Dalamaid','The letters of Bishop Dalamaid have been the subject of volumes of intellectual discourse. The primary contention of the letters, that true saintly martyrdom is an impossibility for anyone even aware of the concept of sainthood, has gone through various levels of favor over the generations. <br><br>\r\n\r\nLetters XIII through XV include a few juicy morsels about a prostitution ring that was run illegally from a monastery of one of the more prestigious orders in Dalamaid\'s time.',25,0.5,0,1,NULL,NULL,1,NULL,1192,NULL,0),(28837,526,'Achuran White Song Birds','A single male White Song bird. The female seems to have died, perhaps due to the stress of recent events.\n\nThe White Song was once the symbol of the Achura\'s Imperial line. Only government buildings were allowed to keep White Songs in captivity. It was said that when the last White Song left the Royal Tower, the Achura Empire would die. The Achura Empire died first, but the White Song is still regarded with great reverence. ',0.02,0.01,0,1,NULL,NULL,1,NULL,1641,NULL,0),(28838,526,'Armor of Rouvenor','Rouvenor is supposedly a mythical hero-king of Garoun, the temporal paradise that has been the subject of poetry, story, and song for centuries. If legends are to be believed, this armor was worn by Rouvenor when he faced the seven armies of Morthane. <br><br>\r\nStrangely, a few of the gold accents are turning slightly green.',35,1,0,1,NULL,NULL,1,NULL,1030,NULL,0),(28839,319,'Blood Raider Cathedral (weak)','This impressive structure operates as a place for religious practice and the throne of a high ranking member within the clergy.',100000,100000000,10000,1,NULL,NULL,0,NULL,NULL,NULL,2401),(28840,1194,'Magic Crystal Ball','Allows you to see into <i>the future</i>, albeit rather murkily.\r\n\r\nWarning: Side-effects may include speculation, jumping to conclusions, overanalysis, misunderstandings, unwarranted assumptions, endless discussions, baseless concerns, undue panic, virtual stampedes, threadnaughts, premature pod ejection and unneeded stress. USE WITH CAUTION.',1,1,0,1,NULL,NULL,1,1661,3232,NULL,0),(28841,306,'Cargo Container - Encoded Data Chip','This cargo container is flimsily constructed and will not survive the rigors of space for long.',10000,27500,2700,1,NULL,NULL,0,NULL,16,NULL,1176),(28842,283,'Amarr Sympathizer','This Minmatar politician pleads his innocence whenever you look his way. He claims that he has been framed, that everything has been a complex scheme to discredit his family. His tattoos mark him as not as a Nefantar, but as one of the member tribes of the Republic. His body is heavily bruised, but whether the injuries are from the Amarr agents or the Minmatar guards is hard to tell. Perhaps only the Republic courts can decide his innocence. ',85,1,0,1,NULL,NULL,1,NULL,2536,NULL,0),(28843,314,'Altered Datacore - Mechanical Engineering','This datacore has been altered and thus rendered useless for manufacturing purposes. It has value only as a reference tool. ',0.75,0.1,0,1,NULL,NULL,1,NULL,3231,NULL,0),(28844,902,'Rhea','It wasn\'t long after the Thukkers began deploying their jump capable freighters that other corporations saw the inherent tactical value of such ships. After extended negotiations, Ishukone finally closed a deal exchanging undisclosed technical data for the core innovations underpinning the original Thukker Tribes design allowing them to rapidly bring to the market the largest jump capable freighter of them all, the Rhea, a true behemoth of the stars.\n\nDeveloper: Ishukone\n\nIshukone, always striving to be ahead of the competition, have proved themselves to be one of the most adept starship designers in the State. A surprising majority of the Caldari Fleets ships of the line were created by their designers. Respected and feared by their peers Ishukone remain amongst the very top of the Caldari corporate machine.',960000000,16250000,144000,1,1,2307653428.0000,1,1091,NULL,20069,20277),(28845,525,'Rhea Blueprint','',0,0.01,0,1,NULL,2000000000.0000,1,NULL,NULL,NULL,309),(28846,902,'Nomad','There is continuing speculation as to how exactly the Thukkers manage to move their vast caravans throughout space relatively undetected, but their expertise with jump drive technology became glaringly apparent when they created the Nomad. Now seeing widespread service with roving Thukker outrider detachments, the Nomad is rapidly becoming an essential part of Thukker life away from the great caravans.\n\nDeveloper: Thukker Mix\n\nThukkers spend their entire lives forever wandering the infinite in their vast caravans. As such their technology is based as much upon necessity as their ingenious ability to tinker. Their ship designs therefore tend to based upon the standard empire templates but extensively modified for the Thukkers unique needs.',820000000,15500000,132000,1,2,2245280772.0000,1,1093,NULL,20077,3360),(28847,525,'Nomad Blueprint','',0,0.01,0,1,NULL,1850000000.0000,1,NULL,NULL,NULL,309),(28848,902,'Anshar','CreoDron surprised many by their quick conception of the Anshar, a stark diversification from their usual drone centric ship designs. The Anshar\'s specially-developed cargo-manipulation drones allowed CreoDron to optimize their loading algorithms and fully utilize every nook and cranny of the ship\'s spacious interior, ensuring it more than holds its own amongst its peers.  \n\nDeveloper: CreoDron\n\nAs the largest drone developer and manufacturer in space, CreoDron has a vested interest in drone carriers but has recently begun to expand their design focus and employ drone techniques on whole other levels which has led some to question where this leap in technology came from.\n',940000000,17550000,137500,1,8,2285192828.0000,1,1092,NULL,20073,3359),(28849,525,'Anshar Blueprint','',0,0.01,0,1,NULL,1950000000.0000,1,NULL,NULL,NULL,309),(28850,902,'Ark','At the end of days when they descend\nWatch for the coming of the Ark\nFor within it\nSalvation is carried.\n\n<i>-The Scriptures, Apocalypse Verses 32:6</i>\n\nDeveloper: Carthum Conglomerate\n\nCarthum ships are the very embodiment of the Amarrian warfare philosophy. Possessing sturdy armor and advanced weapon systems they provide a nice mix of offense and defense. On the other hand, their electronics and shield systems tend to be rather limited.\n\n',900000000,18500000,135000,1,4,2295630314.0000,1,1090,NULL,20062,3357),(28851,525,'Ark Blueprint','',0,0.01,0,1,NULL,1900000000.0000,1,NULL,NULL,NULL,309),(28852,306,'Ancient Starbase Ruins','Ruins.',10000,27500,2700,1,NULL,NULL,0,NULL,NULL,NULL,3778),(28854,319,'Communications Tower','Communications Tower.',100000,100000000,10000,1,NULL,NULL,0,NULL,NULL,NULL,2505),(28859,306,'Cargo Container - Ancient Amarrian Relic','This cargo container is flimsily constructed and will not survive the rigors of space for long.',10000,27500,2700,1,NULL,NULL,0,NULL,16,NULL,1176),(28860,306,'Cargo Container - Ishukone Corporate Records','This cargo container is flimsily constructed and will not survive the rigors of space for long.',10000,27500,2700,1,NULL,NULL,0,NULL,16,NULL,1176),(28861,306,'Cargo Container - Federation Court Logs','This cargo container is flimsily constructed and will not survive the rigors of space for long.',10000,27500,2700,1,NULL,NULL,0,NULL,16,NULL,1176),(28862,306,'Cargo Container - Brutor Tribe Roster','This cargo container is flimsily constructed and will not survive the rigors of space for long.',10000,27500,2700,1,NULL,NULL,0,NULL,16,NULL,1176),(28863,821,'Hashi Keptzh','<font color=yellow>Subject:</font> Hashi Keptzh (ID: Pilot of modified Machariel)<br>\r\n<font color=yellow>Military Specifications:</font> Domination Commander <br>\r\n<font color=yellow>Additional Intelligence:</font> \"Hashi Keptzh? This guy shouldn\'t be too tough. He\'s just a battleship. Get him down. Holy--did he just shoot you? What the hell is this guy flying? Returning fire. Look at his tank! Stop that, you can salvage after the op. <br>\"He\'s tearing through my drones! Warp! Warp! Warp!\" <br>\r\n<i>Unidentified capsuleer transmission during encounter with Hashi Keptzh.</i><br><i>Authorized for capsuleer dissemination.</i>  \r\n',19000000,19000000,120,1,2,NULL,0,NULL,NULL,31,335),(28864,821,'Uehiro Katsen','<font color=yellow>Subject:</font> Uehiro Katsen (ID: Pilot of modified Vindicator)<br>\r\n<font color=yellow>Military Specifications:</font> Serpentis Commander <br>\r\n<font color=yellow>Additional Intelligence:</font>Encounters with Uehiro Katsen have occurred with consistent frequency since YC 109. Every engagement has proven Katsen\'s vessel to be extremely resilient and armed beyond standard Serpentis fittings. Numerous capsuleers have reported success in eliminating the subject, yet the time between sightings is sometimes as low as several hours. It is unknown whether Katsen is himself an unregistered capsuleer, or merely a pseudonym worn by multiple crews.<br>\r\n<i>Agent Cotlamaert Loffeuron, <a href=showinfo:2//1000121>FIO</a>.</i><br><i>Authorized for capsuleer dissemination.</i>  \r\n',17500000,1140000,480,1,8,NULL,0,NULL,NULL,31,2157),(28865,314,'Hive Mind CPU','This cumbersome, alien-looking device, throbbing with light and humming faintly, apparently contains the mind of Professor Kajurei Delainen, somehow fused with the AI of his rogue drone nanites. ',70,5,0,1,NULL,NULL,1,NULL,2225,NULL,0),(28866,314,'Rogue Drone A.I. Core','A tiny chip with a modified silicon-extract wafer forming the base for an integrated circuit. The chip stores the code for the drone\'s bizarre artificial intelligence. ',0.01,0.01,0,1,NULL,NULL,1,NULL,2038,NULL,0),(28867,530,'Inexplicable Drone Junk','Alloys and special materials used in the manufacture of modules based on Ancient technology.',150,20,0,1,NULL,NULL,1,NULL,2890,NULL,0),(28868,314,'Small Warded Container','This small sealed container has been modified with state-of-the-art security measures to prevent ship-to-ship scanning of its contents.',75,5,0,1,NULL,100.0000,1,NULL,1171,NULL,2090),(28869,283,'Amarrian Double-Agent','A spy ostensibly working for the Amarr Empire, but who in fact is a sympathizer with and an agent for the Minmatar Republic.',80,1,0,1,NULL,NULL,1,NULL,2536,NULL,0),(28870,314,'AIMEDs','On most stations, robotic AI Medical Doctors (AIMEDs, more commonly known as \"AI Docs\" or just \"AIDs\") are much more common than human medical practitioners, and much more affordable. ',5000,25,0,1,NULL,100.0000,1,NULL,2304,NULL,0),(28871,1207,'Angel Narcotics Storage Facility','This modified habitat module is being used as storage facility for various items that the pirate factions use for drug manufacturing.  Usually heavily guarded this would undoubtedly reap a bounty with a bit of hacking once past the security.',10000,27500,2700,1,NULL,NULL,0,NULL,NULL,NULL,2516),(28872,1207,'Angel Chemical Laboratory ','This mobile laboratory can be moved and anchored with relative ease, and also tailored towards certain specialties which has led many pirate factions using them in places where creating a fully fledged static facility would be a massive liability.\r\n\r\nThis particular one is being used a chemical research laboratory and is liable to contain some useful items for the entrepreneur after a small amount of hacking.\r\n',10000,27500,2700,1,NULL,NULL,0,NULL,NULL,NULL,2373),(28873,1207,'Guristas Narcotics Storage Facility','This modified habitat module is being used as storage facility for various items that the pirate factions use for drug manufacturin